(5, 1, '2014-04-22 11:15:52', '2014-04-22 10:15:52', 'Dit is een voorbeelpagina. Het verschilt met een blogbericht omdat het altijd op dezelfde plaats staat en in de sitenavigatie voorkomt (in de meeste thema''s). De meeste gebruikers beginnen met een Over mij pagina als introductie aan potentiÃ«le bezoekers. Mogelijk zal dit iets bevatten als:\r\n<blockquote>Hallo! Overdag ben ik werkzaam als postbezorger en in de avonduren werk ik als aspirant acteur. Dit is mijn blog waarin ik over verschillende onderwerpen zal ingaan. Ik woon in Hilversum, heb een geweldige hond genaamd Jack en ik hou van piÃ±a coladas. (En het overvallen worden door regenval.)</blockquote>\r\n...of zoiets als dit:\r\n<blockquote>XYZ Dingetjes BV startte in 1971 en heeft sindsdien talloze dingetjes van hoge kwaliteit aan het publiek geleverd. XYZ is in Bolsward gevestigd, biedt werk aan 2.000 mensen en doet allerlei geweldige dingen voor de Friese gemeenschap.</blockquote>\r\nAls nieuwe WordPress gebruiken is het mogelijk om via <a href="http://test.jessekorver.nl/wp-admin/">het dashboard</a> deze voorbeeldpagina te verwijderen en nieuwe pagina''s te maken voor je site. Veel plezier!', 'Voorbeeld pagina', '', 'inherit', 'open', 'open', '', '2-revision-v1', '', '', '2014-04-22 11:15:52', '2014-04-22 10:15:52', '', 2, 'http://test.jessekorver.nl/?p=5', 0, 'revision', '', 0),
(2, 1, '2014-04-22 10:12:27', '2014-04-22 10:12:27', '<img class="alignnone" style="float: right;" src="http://www.projectpaspoort.nl/wp-content/uploads/2014/10/logo-site-transparent.png" alt="Paspoort naar je toekomstdroom" />\r\n<p style="color: #526567;">Stichting Paspoort naar Â je toekomstdroom, heeft tot doel de leerlingen te begeleiden om vanuit hun kracht en talent te leren denken en niet vanuit hun angsten, problemen of zorgen. De leerlingen onderzoeken spelenderwijs wat hun talenten zijn. Vanuit deze basis leren ze naar hun toekomstige beroep te kijken. Ze leren dat je dromen kunt verwezenlijken, als je maar de juiste stappen neemt.</p>\r\n<p style="color: #526567;">Stichting Paspoort naar Â je toekomstdroom, speelt in op de toenemende behoefte en wensen van de jongeren om zich te identificeren met succesvolle en bekende rolmodellen. Deze behoefte vraagt om nieuwe vormen te ontwikkelen die zowel een ondersteuning als aanvulling bieden aan het bestaande onderwijsprogramma. Dit doen wij door de jongeren spelenderwijs kennis te laten maken met educatie en communicatie.</p>\r\n<p style="color: #526567;"><!--more-->eerste stap naar een succesvolle toekomst is de juiste schoolkeuze. Om uit te vinden welk schooltype bij hen past, moeten de leerlingen nadenken over vragen als: Wie ben ik? Wat kan ik? Wat wil ik? âHet project "Paspoort naar je toekomstdroomâ , faciliteert de leerlingen en de docent hierbij. De rolmodellen uit de TV-,film en sportwereld, die de workshops samen met de docent geven, stimuleren de jongeren extra om serieus met hun toekomst aan de slag te gaan.</p>', 'Home', '', 'publish', 'closed', 'closed', '', 'home', '', '', '2014-11-12 20:34:07', '2014-11-12 19:34:07', '', 0, 'http://test.jessekorver.nl/?page_id=2', 0, 'page', '', 0),
