(20, 1, '2014-04-22 11:51:38', '2014-04-22 10:51:38', '<img class="alignleft" style="float: left;" src="http://www.projectpaspoort.nl/wp-content/uploads/2014/10/ouders.png" alt="ouders" width="160" height="155" />\r\n\r\nDoel van de ouderbijeenkomsten is om ouders kennis te laten nemen van de werkwijze van het project en de projectdoelen en hun bewust te maken van hun eigen rol ten aanzien van de gestelde projectdoelen. De gastdocent geeft op de bijeenkomst een powerpoint presentatie en gaat met de ouders in gesprek over het project en hun kinderen. Waar gewenst zal de ouders ook ondersteuning worden geboden bij hun opvoedingsvragen.\r\n\r\n<img class="alignright" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/fietsen.png" alt="fietsen" />', 'Ouders', '', 'publish', 'closed', 'closed', '', 'ouders', '', '', '2014-10-20 09:33:08', '2014-10-20 08:33:08', '', 45, 'http://test.jessekorver.nl/?page_id=20', 0, 'page', '', 0),
(269, 2, '2014-05-31 09:24:27', '2014-05-31 08:24:27', '<img class="alignnone" style="float: left;" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/ouders.png" alt="ouders" />\r\n\r\nDoel van de ouderbijeenkomsten is om ouders kennis te laten nemen van de\r\n\r\nwerkwijze van het project en de projectdoelen en hun bewust te maken\r\n\r\nvan hun eigen rol ten aanzien van de gestelde projectdoelen. De gastdocent\r\n\r\ngeeft op de bijeenkomst een powerpoint presentatie en gaat met de\r\n\r\nouders in gesprek over het project en hun kinderen. Waar gewenst zal de ouders ook\r\n\r\nondersteuning worden geboden bij hun opvoedingsvragen.\r\n\r\n<img class="alignright" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/fietsen.png" alt="fietsen" />', 'Ouders', '', 'inherit', 'open', 'open', '', '20-revision-v1', '', '', '2014-05-31 09:24:27', '2014-05-31 08:24:27', '', 20, 'http://www.projectpaspoort.nl/20-revision-v1/', 0, 'revision', '', 0),
