(59, 1, '2014-04-30 11:27:13', '2014-04-30 10:27:13', '<div class="large-12 columns space hoek paspoort">\r\n<p style="color: #526567;">Het idee voor Project Paspoort is in 2006 ontstaan nadat jongeren uit Amsterdam Nieuw West in gesprekken met medewerkers van het Team Leerplicht aangaven dat zij voor hun jongere broers en zussen een betere toekomst wensten en hier graag zelf aan bij zouden willen dragen.</p>\r\n<p style="color: #526567;">Mohamed Chaara, acteur van Marokkaanse komaf die een hoofdrol speelde in kaskrakers als Shouf Shouf Habibi en het Schnitzelparadijs, heeft deze uitdaging opgepakt. Hij startte met een aantal proeflessen op basisscholen in Amsterdam Osdorp. Doordat leerlingen zich konden identificeren met het levensverhaal van Mohamed Chaara en de andere acteurs en doordat de rolmodellen theatertechnieken inzetten als instrument ontstond er een sfeer van vertrouwen en contact waarin de jongeren bereid waren na te denken over wie ze zijn, waar ze goed in waren en hoe ze deze talenten verder konden ontwikkelen.</p>\r\n<p style="color: #526567;">Het project levert daarmee concrete bijdrage aan het jeugdbeleid.</p>\r\n<p style="color: #526567;">De reacties van docenten en leerlingen op deze vijf proeflessen waren zeer positief. Na een eveneens zeer positieve externe evaluatie van het project, besloten Stadsdeel Osdorp en Koers Nieuw West het project ook op andere scholen in Amsterdam Nieuw-West te laten starten. Inmiddels wordt het project uitgevoerd op meer dan 100 scholen in de randstad.</p></div>', 'Ontstaan', '', 'publish', 'closed', 'closed', '', 'ontstaan', '', '', '2014-10-17 13:21:04', '2014-10-17 12:21:04', '', 45, 'http://test.jessekorver.nl/?page_id=59', 0, 'page', '', 0),
