(45, 1, '2014-04-24 10:25:42', '2014-04-24 09:25:42', '<div class="large-12 columns space hoek paspoort">\r\n<h3>Paspoort naar je toekomstdroom</h3>\r\n<p>Project Paspoort heeft tot doel de leerlingen te begeleiden om vanuit hun kracht en talent te leren denken en niet vanuit hun angsten, problemen of zorgen. De leerlingen onderzoeken spelenderwijs wat hun talenten zijn. Vanuit deze basis leren ze naar hun toekomstig beroep te kijken. Ze leren dat je dromen kunt verwezenlijken, als je maar de juiste stappen neemt.</p>\r\n\r\nProject Paspoort speelt in op de toenemende behoefte en wensen van de jongeren om zich te identificeren met succesvolle en bekende rolmodellen. Deze behoefte vraagt om nieuwe vormen te ontwikkelen die zowel een ondersteuning als aanvulling bieden aan het bestaande onderwijsprogramma. Dit doen wij door de jongeren spelenderwijs kennis te laten maken met educatie en communicatie.\r\n</div>\r\n\r\n<div class="large-12 columns space hoek paspoort">\r\n<h3>Onstaan</h3>\r\n<p>Het idee voor Project Paspoort is in 2006 ontstaan nadat jongeren uit Amsterdam Nieuw West in gesprekken met medewerkers van het Team Leerplicht aangaven dat zij voor hun jongere broers en zussen een betere toekomst wensten en hier graag zelf aan bij zouden willen dragen.</p>\r\n<p>Mohamed Chaara, acteur van Marokkaanse komaf die een hoofdrol speelde in kaskrakers als Shouf Shouf Habibi en het Schnitzelparadijs, heeft deze uitdaging opgepakt. Hij startte met een aantal proeflessen op basisscholen in Amsterdam Osdorp. Doordat leerlingen zich konden identificeren met het levensverhaal van Mohamed Chaara en de andere acteurs en doordat de rolmodellen theatertechnieken inzetten als instrument ontstond er een sfeer van vertrouwen en contact waarin de jongeren bereid waren na te denken over wie ze zijn, waar ze goed in waren en hoe ze deze talenten verder konden ontwikkelen.</p>\r\n<p>Het project levert daarmee concrete bijdrage aan het jeugdbeleid.</p>\r\n<p>De reacties van docenten en leerlingen op deze vijf proeflessen waren zeer positief. Na een eveneens zeer positieve externe evaluatie van het project, besloten Stadsdeel Osdorp en Koers Nieuw West het project ook op andere scholen in Amsterdam Nieuw-West te laten starten. Inmiddels wordt het project uitgevoerd op meer dan 100 scholen in de randstad.</p>\r\n</div>\r\n', 'Project Paspoort         ', '', 'publish', 'closed', 'closed', '', 'projecten', '', '', '2014-10-17 13:58:05', '2014-10-17 12:58:05', '', 0, 'http://test.jessekorver.nl/?page_id=45', 0, 'page', '', 0),
(40, 1, '2014-05-28 11:16:04', '2014-05-28 10:16:04', '<img class="alignnone" style="float: right;" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/logo-site-transparent.png" alt="Paspoort naar je toekomstdroom" />\n<p style="color: #526567;">Stichting Paspoort naar Â je toekomsdroom, heeft tot doel de leerlingen te begeleiden om vanuit hun kracht en talent te leren denken en niet vanuit hun angsten, problemen of zorgen. De leerlingen onderzoeken spelenderwijs wat hun talenten zijn. Vanuit deze basis leren ze naar hun toekomstige beroep te kijken. Ze leren dat je dromen kunt verwezenlijken, als je maar de juiste stappen neemt.</p>\n<p style="color: #526567;">Stichting Paspoort naar Â je toekomsdroom, speelt in op de toenemende behoefte en wensen van de jongeren om zich te identificeren met succesvolle en bekende rolmodellen. Deze behoefte vraagt om nieuwe vormen te ontwikkelen die zowel een ondersteuning als aanvulling bieden aan het bestaande onderwijsprogramma. Dit doen wij door de jongeren spelenderwijs kennis te laten maken met educatie en communicatie.</p>\n<p style="color: #526567;">Een eerste stap naar een succesvolle toekomst is de juiste schoolkeuze. Om uit te vinden welk schooltype bij hen past, moeten de leerlingen nadenken over vragen als: Wie ben ik? Wat kan ik? Wat wil ik? ââPaspoort naar je toekomstdroom!â faciliteert de leerlingen en de docent hierbij. De rolmodellen uit de TV-,film-, en sportwereld, die de workshops samen met de docent geven, stimuleren de jongeren extra om serieus met hun toekomst aan de slag te gaan.</p>', 'Home', '', 'inherit', 'open', 'open', '', '2-autosave-v1', '', '', '2014-05-28 11:16:04', '2014-05-28 10:16:04', '', 2, 'http://test.jessekorver.nl/2-autosave-v1/', 0, 'revision', '', 0),
