(64, 1, '2014-04-30 11:29:11', '2014-04-30 10:29:11', '<div class="large-12 columns space hoek paspoort">\r\n<img class="alignnone" style="float: left;" src="http://www.projectpaspoort.nl/wp-content/uploads/2014/10/aardbol.png" alt="aardbol" />\r\n\r\nProject Paspoort heeft ten doel om jongeren in het primair onderwijs te helpen bij de zoektocht naar hun identiteit, talenten en kwaliteiten, om deze talenten en kwaliteiten vervolgens verder te ontwikkelen en toe te passen in de aanloop naar hun carriÃ¨reProject Paspoort speelt in op de toenemende behoefte en wensen van de jongeren om zich te identificeren met succesvolle en bekende rolmodellen.\r\nDeze behoefte vraagt om nieuwe vormen te ontwikkelen die zowel een ondersteuning als aanvulling bieden aan het bestaande onderwijsprogramma. Dit doen wij door de jongeren spelenderwijs kennis te laten maken met educatie en communicatie.\r\n\r\nProject Paspoort is een visie op talentontwikkeling waarbij op persoonlijke manier ondersteund wordt bij het ontwikkelen van je dromen. Door het gebruik van komedie en sketches in de lesmethode in combinatie met de inzet van rolmodellen welke maatschappelijk geslaagd zijn, biedt het project de jongeren een unieke kans tot zelfontplooiing.\r\n\r\n<img class="alignright" src="http://www.projectpaspoort.nl/wp-content/uploads/2014/10/busje.png" alt="busje" />\r\n</div>\r\n<div class="large-12 medium-12 columns hoek space fondsSlider">\r\n[slideshow_deploy id=''351'']\r\n</div>', 'Bedrijven', '', 'publish', 'closed', 'closed', '', 'bedrijven', '', '', '2014-10-23 10:37:31', '2014-10-23 09:37:31', '', 0, 'http://test.jessekorver.nl/?page_id=64', 0, 'page', '', 0),
(285, 1, '2014-06-03 14:29:07', '2014-06-03 13:29:07', '<img class="alignnone" style="float: left;" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/aardbol.png" alt="aardbol" />\r\n\r\nProject Paspoort heeft ten doel om jongeren in het primair onderwijs te helpen bij de zoektocht naar hun identiteit, talenten en kwaliteiten, om deze talenten en kwaliteiten vervolgens verder te ontwikkelen en toe te passen in de aanloop naar hun carriÃ¨reProject Paspoort speelt in op de toenemende behoefte en wensen van de jongeren om zich te identificeren met succesvolle en bekende rolmodellen.\r\nDeze behoefte vraagt om nieuwe vormen te ontwikkelen die zowel een ondersteuning als aanvulling bieden aan het bestaande onderwijsprogramma. Dit doen wij door de jongeren spelenderwijs kennis te laten maken met educatie en communicatie.\r\n<!--more-->\r\n\r\n<img class="alignright" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/busje.png" alt="busje" />', 'Bedrijven', '', 'inherit', 'open', 'open', '', '64-revision-v1', '', '', '2014-06-03 14:29:07', '2014-06-03 13:29:07', '', 64, 'http://www.projectpaspoort.nl/64-revision-v1/', 0, 'revision', '', 0),
(274, 1, '2014-06-03 10:44:07', '2014-06-03 09:44:07', '<img class="alignnone" style="float: left;" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/aardbol.png" alt="aardbol" />\r\nProject Paspoort heeft ten doel om jongeren in het primair onderwijs te helpen bij de zoektocht naar hun identiteit, talenten en kwaliteiten, om deze talenten en kwaliteiten vervolgens verder te ontwikkelen en toe te passen in de aanloop naar hun carriÃ¨reProject Paspoort speelt in op de toenemende behoefte en wensen van de jongeren om zich te identificeren met succesvolle en bekende rolmodellen.\r\nDeze behoefte vraagt om nieuwe vormen te ontwikkelen die zowel een ondersteuning als aanvulling bieden aan het bestaande onderwijsprogramma. Dit doen wij door de jongeren spelenderwijs kennis te laten maken met educatie en communicatie.\r\n\r\nProject Paspoort is een visie op talentontwikkeling waarbij op persoonlijke manier ondersteund wordt bij het ontwikkelen van je dromen. Door het gebruik van komedie en sketches in de lesmethode in combinatie met de inzet van rolmodellen welke maatschappelijk geslaagd zijn, biedt het project de jongeren een unieke kans tot zelfontplooiing.\r\n\r\n<img class="alignright" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/busje.png" alt="busje" />', 'Bedrijven', '', 'inherit', 'open', 'open', '', '64-revision-v1', '', '', '2014-06-03 10:44:07', '2014-06-03 09:44:07', '', 64, 'http://www.projectpaspoort.nl/64-revision-v1/', 0, 'revision', '', 0),
(65, 1, '2014-04-30 11:29:11', '2014-04-30 10:29:11', '<p style="color: #526567;">Project Paspoort heeft ten doel om jongeren in het primair onderwijs te helpen bij de zoektocht naar hun identiteit, talenten en kwaliteiten, om deze talenten en kwaliteiten vervolgens verder te ontwikkelen en toe te passen in de aanloop naar hun carriÃ¨re.</p>\r\n<p style="color: #526567;">Project Paspoort speelt in op de toenemende behoefte en wensen van de jongeren om zich te identificeren met succesvolle en bekende rolmodellen. Deze behoefte vraagt om nieuwe vormen te ontwikkelen die zowel een ondersteuning als aanvulling bieden aan het bestaande onderwijsprogramma. Dit doen wij door de jongeren spelenderwijs kennis te laten maken met educatie en communicatie.</p>\r\n<p style="color: #526567;">Daarnaast richten wij op het verbeteren van de maatschappelijke positie van jongeren in Amsterdam. Wij willen met onze fysieke aanwezigheid in Amsterdam Nieuw West een positieve bijdrage leveren en dicht bij onze doelgroep aan de slag gaan.</p>', 'bedrijven', '', 'inherit', 'open', 'open', '', '64-revision-v1', '', '', '2014-04-30 11:29:11', '2014-04-30 10:29:11', '', 64, 'http://test.jessekorver.nl/64-revision-v1/', 0, 'revision', '', 0),
