(82, 1, '2014-10-17 13:30:38', '2014-10-17 12:30:38', '<div class="large-12 columns space hoek paspoort">\n<img class="alignnone" style="float: left;" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/aardbol.png" alt="aardbol" />\n\nProject Paspoort heeft ten doel om jongeren in het primair onderwijs te helpen bij de zoektocht naar hun identiteit, talenten en kwaliteiten, om deze talenten en kwaliteiten vervolgens verder te ontwikkelen en toe te passen in de aanloop naar hun carriÃ¨reProject Paspoort speelt in op de toenemende behoefte en wensen van de jongeren om zich te identificeren met succesvolle en bekende rolmodellen.\nDeze behoefte vraagt om nieuwe vormen te ontwikkelen die zowel een ondersteuning als aanvulling bieden aan het bestaande onderwijsprogramma. Dit doen wij door de jongeren spelenderwijs kennis te laten maken met educatie en communicatie.\n\nProject Paspoort is een visie op talentontwikkeling waarbij op persoonlijke manier ondersteund wordt bij het ontwikkelen van je dromen. Door het gebruik van komedie en sketches in de lesmethode in combinatie met de inzet van rolmodellen welke maatschappelijk geslaagd zijn, biedt het project de jongeren een unieke kans tot zelfontplooiing.\n\n<img class="alignright" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/busje.png" alt="busje" />\n</div>\n<div class="large-12 medium-12 columns hoek space fondsSlider">\n[slideshow_deploy id=''351'']\n</div>', 'Bedrijven', '', 'inherit', 'open', 'open', '', '64-autosave-v1', '', '', '2014-10-17 13:30:38', '2014-10-17 12:30:38', '', 64, 'http://test.jessekorver.nl/64-autosave-v1/', 0, 'revision', '', 0),
