(94, 1, '2014-10-20 09:32:46', '2014-10-20 08:32:46', '<a href="http://www.projectpaspoort.nl/wp-content/uploads/2014/10/ouders.png"><img src="http://www.projectpaspoort.nl/wp-content/uploads/2014/10/ouders-150x150.png" alt="ouders" class="alignnone" /></a><img class="alignleft" style="float: left;" src="http://www.projectpaspoort.nl/?attachment_id=371 " alt="ouders" width="160" height="155" />\n\nDoel van de ouderbijeenkomsten is om ouders kennis te laten nemen van de werkwijze van het project en de projectdoelen en hun bewust te maken van hun eigen rol ten aanzien van de gestelde projectdoelen. De gastdocent geeft op de bijeenkomst een powerpoint presentatie en gaat met de ouders in gesprek over het project en hun kinderen. Waar gewenst zal de ouders ook ondersteuning worden geboden bij hun opvoedingsvragen.\n\n<img class="alignright" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/fietsen.png" alt="fietsen" />', 'Ouders', '', 'inherit', 'open', 'open', '', '20-autosave-v1', '', '', '2014-10-20 09:32:46', '2014-10-20 08:32:46', '', 20, 'http://test.jessekorver.nl/20-autosave-v1/', 0, 'revision', '', 0),
