(120, 1, '2014-05-06 15:12:44', '2014-05-06 14:12:44', '<p style="color: #526567;">Project Paspoort heeft tot doel de leerlingen te begeleiden om vanuit hun kracht en talent te leren denken en niet vanuit hun angsten, problemen of zorgen. De leerlingen onderzoeken spelenderwijs wat hun talenten zijn. Vanuit deze basis leren ze naar hun toekomstig beroep te kijken. Ze leren dat je dromen kunt verwezenlijken, als je maar de juiste stappen neemt.</p>\r\n<p style="color: #526567;">Project Paspoort speelt in op de toenemende behoefte en wensen van de jongeren om zich te identificeren met succesvolle en bekende rolmodellen. Deze behoefte vraagt om nieuwe vormen te ontwikkelen die zowel een ondersteuning als aanvulling bieden aan het bestaande onderwijsprogramma. Dit doen wij door de jongeren spelenderwijs kennis te laten maken met educatie en communicatie.</p>', 'over ons', '', 'inherit', 'open', 'open', '', '59-revision-v1', '', '', '2014-05-06 15:12:44', '2014-05-06 14:12:44', '', 59, 'http://test.jessekorver.nl/59-revision-v1/', 0, 'revision', '', 0),
(121, 1, '2014-05-06 15:12:58', '2014-05-06 14:12:58', '<p class="hel2">Project Paspoort en de basisschool</p>\r\n<img class="alignleft" style="float: left;" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/map.png" alt="map" width="134" height="109" />Het project richt zich op leerlingen uit groep 7/8 van het basisonderwijs.Project Paspoort heeft tot doel de leerlingen te begeleiden om vanuit hun kracht en talent te leren denken en niet vanuit hun angsten, problemen of zorgen. De leerlingen onderzoeken spelenderwijs wat hun talenten zijn. Vanuit deze basis leren ze naar hun toekomstig beroep te kijken. Ze leren dat je dromen kunt verwezenlijken, als je maar de juiste stappen neemt.\r\n\r\nHet doel van het project sluit aan bij de kerndoelen van het ministerie van OC&amp;W op het gebied van de sociaal emotionele ontwikkeling. In het bijzonder bij kerndoelnummer 34: âOriÃ«ntatie op jezelf en de wereld, mens en samenleving.â Project Paspoort is een vierdelige lessenserie die speciaal is ontwikkeld voor groep 8. Een schakeljaar waarin kinderen en hun ouders voor belangrijke keuzes staan, die bepalend zijn voor de toekomst van het kind. Zij moeten erachter komen welk schooltype geschikt is voor het kind. Om deze vraag te kunnen beantwoorden, moeten de kinderen gaan nadenken over de vragen: Wie ben ik? Wat kan ik? Wat wil ik?\r\n\r\nNa de opening van de les door een bekende gastdocent, gaat de reguliere docente twee weken verder met het thema. In de tussenliggende weken kunnen de schooldocenten ter verdieping met de leerlingen extra opdrachten uitvoeren.', 'scholen', '', 'inherit', 'open', 'open', '', '61-revision-v1', '', '', '2014-05-06 15:12:58', '2014-05-06 14:12:58', '', 61, 'http://test.jessekorver.nl/61-revision-v1/', 0, 'revision', '', 0),
(122, 1, '2014-05-06 15:17:28', '2014-05-06 14:17:28', '<img class="alignnone" style="float: left;" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/aardbol.png" alt="aardbol" />\r\n<p class="hel3">Project paspoort en investeerders</p>\r\nProject Paspoort heeft ten doel om jongeren in het primair onderwijs te helpen bij de zoektocht naar hun identiteit, talenten en kwaliteiten, om deze talenten en kwaliteiten vervolgens verder te ontwikkelen en toe te passen in de aanloop naar hun carriÃ¨reProject Paspoort speelt in op de toenemende behoefte en wensen van de jongeren om zich te identificeren met succesvolle en bekende rolmodellen.\r\n\r\nDeze behoefte vraagt om nieuwe vormen te ontwikkelen die zowel een ondersteuning als aanvulling bieden aan het bestaande onderwijsprogramma. Dit doen wij door de jongeren spelenderwijs kennis te laten maken met educatie en communicatie.\r\n\r\nProject Paspoort is een visie op talentontwikkeling waarbij op persoonlijke manier ondersteund wordt bij het ontwikkelen van je dromen. Door het gebruik van komedie en sketches in de lesmethode in combinatie met de inzet van rolmodellen welke maatschappelijk geslaagd zijn, biedt het project de jongeren een unieke kans tot zelfontplooiing.\r\n\r\n<img class="alignright" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/busje.png" alt="busje" />', 'bedrijven', '', 'inherit', 'open', 'open', '', '64-revision-v1', '', '', '2014-05-06 15:17:28', '2014-05-06 14:17:28', '', 64, 'http://test.jessekorver.nl/64-revision-v1/', 0, 'revision', '', 0),
(123, 1, '2014-05-06 15:17:38', '2014-05-06 14:17:38', '<img class="alignnone" style="float: left;" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/ouders.png" alt="ouders" />\r\n<p class="hel2">Project paspoort en ouders</p>\r\nProject Paspoort heeft ten doel om jongeren in het primair onderwijs te helpen bij de zoektocht naar hun identiteit, talenten en kwaliteiten, om deze talenten en kwaliteiten vervolgens verder te ontwikkelen en toe te passen in de aanloop naar hun carriÃ¨reProject Paspoort speelt in op de toenemende behoefte en wensen van de jongeren om zich te identificeren met succesvolle en bekende rolmodellen.\r\n\r\nDeze behoefte vraagt om nieuwe vormen te ontwikkelen die zowel een ondersteuning als aanvulling bieden aan het bestaande onderwijsprogramma. Dit doen wij door de jongeren spelenderwijs kennis te laten maken met educatie en communicatie.\r\n\r\nProject Paspoort is een visie op talentontwikkeling waarbij op persoonlijke manier ondersteund wordt bij het ontwikkelen van je dromen. Door het gebruik van komedie en sketches in de lesmethode in combinatie met de inzet van rolmodellen welke maatschappelijk geslaagd zijn, biedt het project de jongeren een unieke kans tot zelfontplooiing.\r\n<img class="alignright" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/fietsen.png" alt="fietsen" />', 'Ouders', '', 'inherit', 'open', 'open', '', '20-revision-v1', '', '', '2014-05-06 15:17:38', '2014-05-06 14:17:38', '', 20, 'http://test.jessekorver.nl/20-revision-v1/', 0, 'revision', '', 0),
