(145, 1, '2014-05-13 10:18:03', '2014-05-13 09:18:03', '<p style="color: #526567;">Project Paspoort heeft tot doel de leerlingen te begeleiden om vanuit hun kracht en talent te leren denken en niet vanuit hun angsten, problemen of zorgen. De leerlingen onderzoeken spelenderwijs wat hun talenten zijn. Vanuit deze basis leren ze naar hun toekomstig beroep te kijken. Ze leren dat je dromen kunt verwezenlijken, als je maar de juiste stappen neemt.</p>\r\n<p style="color: #526567;">Project Paspoort speelt in op de toenemende behoefte en wensen van de jongeren om zich te identificeren met succesvolle en bekende rolmodellen. Deze behoefte vraagt om nieuwe vormen te ontwikkelen die zowel een ondersteuning als aanvulling bieden aan het bestaande onderwijsprogramma. Dit doen wij door de jongeren spelenderwijs kennis te laten maken met educatie en communicatie.</p>', 'over ons', '', 'inherit', 'open', 'open', '', '59-revision-v1', '', '', '2014-05-13 10:18:03', '2014-05-13 09:18:03', '', 59, 'http://test.jessekorver.nl/59-revision-v1/', 0, 'revision', '', 0),
(146, 1, '2014-05-13 10:18:14', '2014-05-13 09:18:14', '<p class="hel2">Project Paspoort en de basisschool</p>\r\n<img class="alignleft" style="float: left;" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/map.png" alt="map" width="134" height="109" />Het project richt zich op leerlingen uit groep 7/8 van het basisonderwijs.Project Paspoort heeft tot doel de leerlingen te begeleiden om vanuit hun kracht en talent te leren denken en niet vanuit hun angsten, problemen of zorgen. De leerlingen onderzoeken spelenderwijs wat hun talenten zijn. Vanuit deze basis leren ze naar hun toekomstig beroep te kijken. Ze leren dat je dromen kunt verwezenlijken, als je maar de juiste stappen neemt.\r\n\r\nHet doel van het project sluit aan bij de kerndoelen van het ministerie van OC&amp;W op het gebied van de sociaal emotionele ontwikkeling. In het bijzonder bij kerndoelnummer 34: âOriÃ«ntatie op jezelf en de wereld, mens en samenleving.â Project Paspoort is een vierdelige lessenserie die speciaal is ontwikkeld voor groep 8. Een schakeljaar waarin kinderen en hun ouders voor belangrijke keuzes staan, die bepalend zijn voor de toekomst van het kind. Zij moeten erachter komen welk schooltype geschikt is voor het kind. Om deze vraag te kunnen beantwoorden, moeten de kinderen gaan nadenken over de vragen: Wie ben ik? Wat kan ik? Wat wil ik?\r\n\r\nNa de opening van de les door een bekende gastdocent, gaat de reguliere docente twee weken verder met het thema. In de tussenliggende weken kunnen de schooldocenten ter verdieping met de leerlingen extra opdrachten uitvoeren.', 'scholen', '', 'inherit', 'open', 'open', '', '61-revision-v1', '', '', '2014-05-13 10:18:14', '2014-05-13 09:18:14', '', 61, 'http://test.jessekorver.nl/61-revision-v1/', 0, 'revision', '', 0),
(147, 1, '2014-05-13 10:18:30', '2014-05-13 09:18:30', 'Project Paspoort heeft tot doel de leerlingen te begeleiden om vanuit hun kracht en talent te leren denken en niet vanuit hun angsten, problemen of zorgen. De leerlingen onderzoeken spelenderwijs wat hun talenten zijn. Vanuit deze basis leren ze naar hun toekomstig beroep te kijken. Ze leren dat je dromen kunt verwezenlijken, als je maar de juiste stappen neemt.\r\n\r\nProject Paspoort speelt in op de toenemende behoefte en wensen van de jongeren om zich te identificeren met succesvolle en bekende rolmodellen. Deze behoefte vraagt om nieuwe vormen te ontwikkelen die zowel een ondersteuning als aanvulling bieden aan het bestaande onderwijsprogramma. Dit doen wij door de jongeren spelenderwijs kennis te laten maken met educatie en communicatie.', 'Project Paspoort', '', 'inherit', 'open', 'open', '', '45-revision-v1', '', '', '2014-05-13 10:18:30', '2014-05-13 09:18:30', '', 45, 'http://test.jessekorver.nl/45-revision-v1/', 0, 'revision', '', 0),
