(168, 1, '2014-05-14 10:30:22', '2014-05-14 09:30:22', '<span class="hel4">Over ons</span>\r\nProject Paspoort heeft tot doel de leerlingen te begeleiden om vanuit hun kracht en talent te leren denken en niet vanuit hun angsten, problemen of zorgen. De leerlingen onderzoeken spelenderwijs wat hun talenten zijn. Vanuit deze basis leren ze naar hun toekomstig beroep te kijken. Ze leren dat je dromen kunt verwezenlijken, als je maar de juiste stappen neemt.\r\nProject Paspoort speelt in op de toenemende behoefte en wensen van de jongeren om zich te identificeren met succesvolle en bekende rolmodellen. Deze behoefte vraagt om nieuwe vormen te ontwikkelen die zowel een ondersteuning als aanvulling bieden aan het bestaande onderwijsprogramma. Dit doen wij door de jongeren spelenderwijs kennis te laten maken met educatie en communicatie.\r\nEen eerste stap naar een succesvolle toekomst is de juiste schoolkeuze. Om uit te vinden welk schooltype bij hen past, moeten de leerlingen nadenken over vragen als: Wie ben ik? Wat kan ik? Wat wil ik? ââPaspoort naar je toekomstdroom!â faciliteert de leerlingen en de docent hierbij. De rolmodellen uit de TV-,film-, en sportwereld, die de workshops samen met de docent geven, stimuleren de jongeren extra om serieus met hun toekomst aan de slag te gaan.', 'over ons', '', 'inherit', 'open', 'open', '', '59-revision-v1', '', '', '2014-05-14 10:30:22', '2014-05-14 09:30:22', '', 59, 'http://test.jessekorver.nl/59-revision-v1/', 0, 'revision', '', 0),
