(209, 1, '2014-05-20 10:46:59', '2014-05-20 09:46:59', '<img class="alignleft" style="float: left;" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/aardbol.png" alt="aardbol" />\r\n<h3>Project paspoort en investeerders</h3>\r\nProject Paspoort heeft ten doel om jongeren in het primair onderwijs te helpen bij de zoektocht naar hun identiteit, talenten en kwaliteiten, om deze talenten en kwaliteiten vervolgens verder te ontwikkelen en toe te passen in de aanloop naar hun carriÃ¨reProject Paspoort speelt in op de toenemende behoefte en wensen van de jongeren om zich te identificeren met succesvolle en bekende rolmodellen.\r\n\r\nDeze behoefte vraagt om nieuwe vormen te ontwikkelen die zowel een ondersteuning als aanvulling bieden aan het bestaande onderwijsprogramma. Dit doen wij door de jongeren spelenderwijs kennis te laten maken met educatie en communicatie.\r\n\r\nProject Paspoort is een visie op talentontwikkeling waarbij op persoonlijke manier ondersteund wordt bij het ontwikkelen van je dromen. Door het gebruik van komedie en sketches in de lesmethode in combinatie met de inzet van rolmodellen welke maatschappelijk geslaagd zijn, biedt het project de jongeren een unieke kans tot zelfontplooiing.\r\n\r\n<img class="alignright" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/busje.png" alt="busje" />', 'Bedrijven', '', 'inherit', 'open', 'open', '', '64-revision-v1', '', '', '2014-05-20 10:46:59', '2014-05-20 09:46:59', '', 64, 'http://test.jessekorver.nl/64-revision-v1/', 0, 'revision', '', 0),
(210, 1, '2014-05-20 10:47:10', '2014-05-20 09:47:10', '<img class="alignnone" style="float: left;" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/aardbol.png" alt="aardbol" />\r\n<h3>Project paspoort en investeerders</h3>\r\nProject Paspoort heeft ten doel om jongeren in het primair onderwijs te helpen bij de zoektocht naar hun identiteit, talenten en kwaliteiten, om deze talenten en kwaliteiten vervolgens verder te ontwikkelen en toe te passen in de aanloop naar hun carriÃ¨reProject Paspoort speelt in op de toenemende behoefte en wensen van de jongeren om zich te identificeren met succesvolle en bekende rolmodellen.\r\n\r\nDeze behoefte vraagt om nieuwe vormen te ontwikkelen die zowel een ondersteuning als aanvulling bieden aan het bestaande onderwijsprogramma. Dit doen wij door de jongeren spelenderwijs kennis te laten maken met educatie en communicatie.\r\n\r\nProject Paspoort is een visie op talentontwikkeling waarbij op persoonlijke manier ondersteund wordt bij het ontwikkelen van je dromen. Door het gebruik van komedie en sketches in de lesmethode in combinatie met de inzet van rolmodellen welke maatschappelijk geslaagd zijn, biedt het project de jongeren een unieke kans tot zelfontplooiing.\r\n\r\n<img class="alignright" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/busje.png" alt="busje" />', 'Bedrijven', '', 'inherit', 'open', 'open', '', '64-revision-v1', '', '', '2014-05-20 10:47:10', '2014-05-20 09:47:10', '', 64, 'http://test.jessekorver.nl/64-revision-v1/', 0, 'revision', '', 0),
(212, 1, '2014-05-20 13:24:14', '2014-05-20 12:24:14', '<span class="hel2">ProjectPaspoort.nl</span>\r\nProject Paspoort heeft tot doel de leerlingen te begeleiden om vanuit hun kracht en talent te leren denken en niet vanuit hun angsten, problemen of zorgen. De leerlingen onderzoeken spelenderwijs wat hun talenten zijn. Vanuit deze basis leren ze naar hun toekomstig beroep te kijken. Ze leren dat je dromen kunt verwezenlijken, als je maar de juiste stappen neemt.\r\n\r\nProject Paspoort speelt in op de toenemende behoefte en wensen van de jongeren om zich te identificeren met succesvolle en bekende rolmodellen. Deze behoefte vraagt om nieuwe vormen te ontwikkelen die zowel een ondersteuning als aanvulling bieden aan het bestaande onderwijsprogramma. Dit doen wij door de jongeren spelenderwijs kennis te laten maken met educatie en communicatie.', 'Project Paspoort', '', 'inherit', 'open', 'open', '', '45-revision-v1', '', '', '2014-05-20 13:24:14', '2014-05-20 12:24:14', '', 45, 'http://test.jessekorver.nl/45-revision-v1/', 0, 'revision', '', 0),
