(222, 1, '2014-05-28 10:19:09', '2014-05-28 09:19:09', '<h3>Media</h3>\r\nLorem ipsum dolor sit amet, consectetur adipiscing elit. Morbi blandit sapien id luctus consequat. Proin vitae risus ultrices, mollis nisi eget, cursus mauris. Ut libero eros, venenatis sit amet sapien quis, euismod semper nisi.', 'Media', '', 'inherit', 'open', 'open', '', '11-revision-v1', '', '', '2014-05-28 10:19:09', '2014-05-28 09:19:09', '', 11, 'http://test.jessekorver.nl/11-revision-v1/', 0, 'revision', '', 0),
(224, 1, '2014-05-28 11:17:10', '2014-05-28 10:17:10', '<img class="alignnone" style="float: right;" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/logo-site-transparent.png" alt="Paspoort naar je toekomstdroom" />\r\n<p style="color: #526567;">Stichting Paspoort naar Â je toekomsdroom, heeft tot doel de leerlingen te begeleiden om vanuit hun kracht en talent te leren denken en niet vanuit hun angsten, problemen of zorgen. De leerlingen onderzoeken spelenderwijs wat hun talenten zijn. Vanuit deze basis leren ze naar hun toekomstige beroep te kijken. Ze leren dat je dromen kunt verwezenlijken, als je maar de juiste stappen neemt.</p>\r\n<p style="color: #526567;">Stichting Paspoort naar Â je toekomsdroom, speelt in op de toenemende behoefte en wensen van de jongeren om zich te identificeren met succesvolle en bekende rolmodellen. Deze behoefte vraagt om nieuwe vormen te ontwikkelen die zowel een ondersteuning als aanvulling bieden aan het bestaande onderwijsprogramma. Dit doen wij door de jongeren spelenderwijs kennis te laten maken met educatie en communicatie.</p>\r\n<p style="color: #526567;">Een eerste stap naar een succesvolle toekomst is de juiste schoolkeuze. Om uit te vinden welk schooltype bij hen past, moeten de leerlingen nadenken over vragen als: Wie ben ik? Wat kan ik? Wat wil ik? âHet project "Paspoort naar je toekomstdroomâ , faciliteert de leerlingen en de docent hierbij. De rolmodellen uit de TV-,film en sportwereld, die de workshops samen met de docent geven, stimuleren de jongeren extra om serieus met hun toekomst aan de slag te gaan.</p>', 'Home', '', 'inherit', 'open', 'open', '', '2-revision-v1', '', '', '2014-05-28 11:17:10', '2014-05-28 10:17:10', '', 2, 'http://test.jessekorver.nl/2-revision-v1/', 0, 'revision', '', 0),
