(229, 2, '2014-05-28 12:26:32', '2014-05-28 11:26:32', '<p style="color: #526567;">Het idee voor Project Paspoort is in 2006 ontstaan nadat jongeren uit Amsterdam Nieuw West in gesprekken met medewerkers van het Team Leerplicht aangaven dat zij voor hun jongere broers en zussen een betere toekomst wensten en hier graag zelf aan bij zouden willen dragen.</p>\n<p style="color: #526567;">Mohamed Chaara, acteur van Marokkaanse komaf die een hoofdrol speelde in kaskrakers als Shouf Shouf Habibi en het Schnitzelparadijs, heeft deze uitdaging opgepakt. Hij startte met een aantal proeflessen op basisscholen in Amsterdam Osdorp. Doordat leerlingen zich konden identificeren met het levensverhaal van Mohamed Chaara en de andere acteurs en doordat de rolmodellen theatertechnieken inzetten als instrument ontstond er een sfeer van vertrouwen en contact waarin de jongeren bereid waren na te denken over wie ze zijn, waar ze goed in waren en hoe ze deze talenten verder konden ontwikkelen.</p>\n<p style="color: #526567;">Het project levert daarmee concrete bijdrage aan het jeugdbeleid.</p>\n<p style="color: #526567;">De reacties van docenten en leerlingen op deze vijf proeflessen waren zeer positief. Na een eveneens zeer positieve externe evaluatie van het project, besloten Stadsdeel Osdorp en Koers Nieuw West het project ook op andere scholen in Amsterdam Nieuw-West te laten starten. Inmiddels wordt het project uitgevoerd op meer dan 100 scholen in de randstad.</p>', 'ONTSTAAN', '', 'inherit', 'open', 'open', '', '59-autosave-v1', '', '', '2014-05-28 12:26:32', '2014-05-28 11:26:32', '', 59, 'http://test.jessekorver.nl/59-autosave-v1/', 0, 'revision', '', 0),
(230, 2, '2014-05-28 12:27:03', '2014-05-28 11:27:03', '<p style="color: #526567;">Het idee voor Project Paspoort is in 2006 ontstaan nadat jongeren uit Amsterdam Nieuw West in gesprekken met medewerkers van het Team Leerplicht aangaven dat zij voor hun jongere broers en zussen een betere toekomst wensten en hier graag zelf aan bij zouden willen dragen.</p>\r\n<p style="color: #526567;">Mohamed Chaara, acteur van Marokkaanse komaf die een hoofdrol speelde in kaskrakers als Shouf Shouf Habibi en het Schnitzelparadijs, heeft deze uitdaging opgepakt. Hij startte met een aantal proeflessen op basisscholen in Amsterdam Osdorp. Doordat leerlingen zich konden identificeren met het levensverhaal van Mohamed Chaara en de andere acteurs en doordat de rolmodellen theatertechnieken inzetten als instrument ontstond er een sfeer van vertrouwen en contact waarin de jongeren bereid waren na te denken over wie ze zijn, waar ze goed in waren en hoe ze deze talenten verder konden ontwikkelen.</p>\r\n<p style="color: #526567;">Het project levert daarmee concrete bijdrage aan het jeugdbeleid.</p>\r\n<p style="color: #526567;">De reacties van docenten en leerlingen op deze vijf proeflessen waren zeer positief. Na een eveneens zeer positieve externe evaluatie van het project, besloten Stadsdeel Osdorp en Koers Nieuw West het project ook op andere scholen in Amsterdam Nieuw-West te laten starten. Inmiddels wordt het project uitgevoerd op meer dan 100 scholen in de randstad.</p>', 'ONTSTAAN', '', 'inherit', 'open', 'open', '', '59-revision-v1', '', '', '2014-05-28 12:27:03', '2014-05-28 11:27:03', '', 59, 'http://test.jessekorver.nl/59-revision-v1/', 0, 'revision', '', 0),
(231, 2, '2014-05-28 12:27:42', '2014-05-28 11:27:42', '<p style="color: #526567;">Het idee voor Project Paspoort is in 2006 ontstaan nadat jongeren uit Amsterdam Nieuw West in gesprekken met medewerkers van het Team Leerplicht aangaven dat zij voor hun jongere broers en zussen een betere toekomst wensten en hier graag zelf aan bij zouden willen dragen.</p>\r\n<p style="color: #526567;">Mohamed Chaara, acteur van Marokkaanse komaf die een hoofdrol speelde in kaskrakers als Shouf Shouf Habibi en het Schnitzelparadijs, heeft deze uitdaging opgepakt. Hij startte met een aantal proeflessen op basisscholen in Amsterdam Osdorp. Doordat leerlingen zich konden identificeren met het levensverhaal van Mohamed Chaara en de andere acteurs en doordat de rolmodellen theatertechnieken inzetten als instrument ontstond er een sfeer van vertrouwen en contact waarin de jongeren bereid waren na te denken over wie ze zijn, waar ze goed in waren en hoe ze deze talenten verder konden ontwikkelen.</p>\r\n<p style="color: #526567;">Het project levert daarmee concrete bijdrage aan het jeugdbeleid.</p>\r\n<p style="color: #526567;">De reacties van docenten en leerlingen op deze vijf proeflessen waren zeer positief. Na een eveneens zeer positieve externe evaluatie van het project, besloten Stadsdeel Osdorp en Koers Nieuw West het project ook op andere scholen in Amsterdam Nieuw-West te laten starten. Inmiddels wordt het project uitgevoerd op meer dan 100 scholen in de randstad.</p>', 'Ontstaan', '', 'inherit', 'open', 'open', '', '59-revision-v1', '', '', '2014-05-28 12:27:42', '2014-05-28 11:27:42', '', 59, 'http://test.jessekorver.nl/59-revision-v1/', 0, 'revision', '', 0),
(232, 1, '2014-05-28 12:31:02', '2014-05-28 11:31:02', '<p style="color: #526567;"><strong>Missie</strong>\r\nLeerlingen in het basis onderwijs weerbaarder te maken door hen handvatten te bieden om hun dromen te verwezenlijken en (meer) bewust te maken van hun toekomstmogelijkheden en hen te stimuleren deze dromen waar te maken.</p>\r\n<p style="color: #526567;"><strong>Visie</strong>\r\nProject Paspoort wil de jongeren helpen bij het maken van de juiste keuzes en ze voor te bereiden op hun vervolgopleiding door het inzetten van succesvolle rolmodellen.</p>\r\n\r\n<div class="exp-col-content-holder"><a class="expand-cnt-link" href="#">lees verder</a>\r\n<div class="hidden-content">\r\n<p class="hiddenContentp">Marketingstrategie Project Paspoort Project Paspoort heeft ten doel om jongeren in het primair onderwijs te helpen bij de zoektocht naar hun identiteit, talenten en kwaliteiten, om deze talenten en kwaliteiten vervolgens verder te ontwikkelen en toe te passen in de aanloop naar hun carriÃ¨re.</p>\r\n\r\n<p>Project Paspoort speelt in op de toenemende behoefte en wensen van de jongeren om zich te identificeren met succesvolle en bekende rolmodellen. Deze behoefte vraagt om nieuwe vormen te ontwikkelen die zowel een ondersteuning als aanvulling bieden aan het bestaande onderwijsprogramma. Dit doen wij door de jongeren spelenderwijs kennis te laten maken met educatie en communicatie. Daarnaast richten wij op het verbeteren van de maatschappelijke positie van jongeren in Amsterdam.</p>\r\n\r\n<p>Wij willen met onze fysieke aanwezigheid in Amsterdam Nieuw West een positieve bijdrage leveren en dicht bij onze doelgroep aan de slag gaan. Waarmee onderscheidt Project Paspoort zich van gelijke projecten? Project Paspoort is een visie op talentontwikkeling waarbij op persoonlijke manier ondersteund wordt bij het ontwikkelen van je dromen.</p>\r\n\r\n<p>Door het gebruik van komedie en sketches in de lesmethode in combinatie met de inzet van rolmodellen welke maatschappelijk geslaagd zijn, biedt het project de jongeren een unieke kans tot zelfontplooiing. Dit doen we door begeleiding, kennisdeling en ondersteuning om de jongeren bewust te maken van hun toekomstmogelijkheden en hen te stimuleren deze mogelijkheden ook waar te maken. De combinatie maakt dat het project aanslaat bij de jongeren.</p>\r\n\r\n<p><strong>Omschrijving producten Project Paspoort</strong></p>\r\n\r\n<p>Wij leveren als project Paspoort een gevarieerd aanbod aan educatie middels werkboekjes voor de leerlingen, docentenhandleiding, diverse gadgets voor de leerlingen en door gebruik te maken van een interactieve website.</p>\r\n\r\n<p><strong>Personeelsbeleid</strong></p>\r\n\r\n<p>Binnen de organisatie zijn er verschillende academische disciplines vertegenwoordigd. En bestaat uit 3 vaste krachten en een groot netwerk van freelancers die op specialistische onderdelen worden ingezet.</p>\r\n<p><strong>Op welke wijze, economisch en maatschappelijk, is Project Paspoort belangrijk voor de buurt?</strong></p>\r\n<p>Vestiging in de buurt. â¢ Aantrekken personeelsleden uit de directe omgeving. â¢ Het creÃ«ren van een positief imago door als uithangbord van Amsterdam te fungeren. Maatschappelijk â¢ Betrokkenheid van ouders, jongeren, stadsdelen, onderwijsinstellingen en lokale bedrijven bij het organiseren van evenementen. â¢ CreÃ«ren van uitdagende leef- en schoolomgeving.</p>\r\n\r\n</div>\r\n</div>\r\n\r\n\r\n\r\n ', 'Over ons', '', 'publish', 'open', 'open', '', 'ons', '', '', '2015-07-06 17:45:53', '2015-07-06 16:45:53', '', 0, 'http://test.jessekorver.nl/?page_id=232', 0, 'page', '', 0),
(302, 2, '2014-06-04 08:26:41', '2014-06-04 07:26:41', '<p style="color: #526567;"><strong>Missie</strong>\r\nLeerlingen in het basis onderwijs weerbaarder te maken door hen handvatten te bieden om hun dromen te verwezenlijken en (meer) bewust te maken van hun toekomstmogelijkheden en hen te stimuleren deze dromen waar te maken.</p>\r\n<p style="color: #526567;"><strong>Visie</strong>\r\nProject Paspoort wil de jongeren helpen bij het maken van de juiste keuzes en ze voor te bereiden op hun vervolgopleiding door het inzetten van succesvolle rolmodellen.</p>\r\n\r\n<div class="exp-col-content-holder"><a class="expand-cnt-link" href="#">lees verder</a>\r\n<div class="hidden-content">\r\n<p class="hiddenContentp">Marketingstrategie Project Paspoort Project Paspoort heeft ten doel om jongeren in het primair onderwijs te helpen bij de zoektocht naar hun identiteit, talenten en kwaliteiten, om deze talenten en kwaliteiten vervolgens verder te ontwikkelen en toe te passen in de aanloop naar hun carriÃ¨re. Project Paspoort speelt in op de toenemende behoefte en wensen van de jongeren om zich te identificeren met succesvolle en bekende rolmodellen. Deze behoefte vraagt om nieuwe vormen te ontwikkelen die zowel een ondersteuning als aanvulling bieden aan het bestaande onderwijsprogramma. Dit doen wij door de jongeren spelenderwijs kennis te laten maken met educatie en communicatie. Daarnaast richten wij op het verbeteren van de maatschappelijke positie van jongeren in Amsterdam. Wij willen met onze fysieke aanwezigheid in Amsterdam Nieuw West een positieve bijdrage leveren en dicht bij onze doelgroep aan de slag gaan. Waarmee onderscheidt Project Paspoort zich van gelijke projecten? Project Paspoort is een visie op talentontwikkeling waarbij op persoonlijke manier ondersteund wordt bij het ontwikkelen van je dromen. Door het gebruik van komedie en sketches in de lesmethode in combinatie met de inzet van rolmodellen welke maatschappelijk geslaagd zijn, biedt het project de jongeren een unieke kans tot zelfontplooiing. Dit doen we door begeleiding, kennisdeling en ondersteuning om de jongeren bewust te maken van hun toekomstmogelijkheden en hen te stimuleren deze mogelijkheden ook waar te maken. De combinatie maakt dat het project aanslaat bij de jongeren. Omschrijving producten Project Paspoort Wij leveren als project Paspoort een gevarieerd aanbod aan educatie middels werkboekjes voor de leerlingen, docentenhandleiding, diverse gadgets voor de leerlingen en door gebruik te maken van een interactieve website. Personeelsbeleid Binnen de organisatie zijn er verschillende academische disciplines vertegenwoordigd. En bestaat uit 3 vaste krachten en een groot netwerk van freelancers die op specialistische onderdelen worden ingezet. Op welke wijze, economisch en maatschappelijk, is Project Paspoort belangrijk voor de buurt? Economisch â¢ Vestiging in de buurt. â¢ Aantrekken personeelsleden uit de directe omgeving. â¢ Het creÃ«ren van een positief imago door als uithangbord van Amsterdam te fungeren. Maatschappelijk â¢ Betrokkenheid van ouders, jongeren, stadsdelen, onderwijsinstellingen en lokale bedrijven bij het organiseren van evenementen. â¢ CreÃ«ren van uitdagende leef- en schoolomgeving.</p>\r\n\r\n</div>\r\n</div>\r\n&nbsp;\r\n<p style="color: #526567;"></p>', 'Over ons', '', 'inherit', 'open', 'open', '', '232-revision-v1', '', '', '2014-06-04 08:26:41', '2014-06-04 07:26:41', '', 232, 'http://www.projectpaspoort.nl/232-revision-v1/', 0, 'revision', '', 0),
