(236, 2, '2014-07-11 14:13:54', '2014-07-11 13:13:54', '<p class="p1">Beste allen,</p>\r\n<p class="p2">Nogmaals erg bedankt voor jullie betrokkenheid bij de pilot-uitvoering van Tweens Talent. We hebben met dit fantastische event ruim 1000 leerlingen van 21 basisscholen kunnen inspireren en motiveren bij het ontdekken van hun talenten en het uitstippelen van het traject naar hun toekomstdroom.</p>\r\n<p class="p2">Samen zijn we een hele ervaring rijker en we hebben alle intentie volgend jaar een nog mooiere editie van Tweens Talent te realiseren.</p>\r\n<p class="p2">Er volgen deze week meerdere foto''s. Ik verwijs jullie daarom graag naar de linkÂ <span class="s1"><a href="http://facebook.com/Tweenstalent">facebook.com/Tweenstalent</a>Â </span>voor alle foto''s en filmpjes en natuurlijk ook een leuke item van gister op het<a title="jeugdjournaal" href="%20http://jeugdjournaal.nl/uitzending/avond/2014-01-14" target="_blank"> jeugdjournaal!!!.</a></p>\r\n<p class="p2">Zie:Â <a href="http://jeugdjournaal.nl/uitzending/avond/2014-01-14"><span class="s1">http://jeugdjournaal.nl/uitzending/avond/2014-01-14</span></a></p>\r\n<p class="p2">Zie ook:Â <a title="tweenstalent promo" href="https://www.youtube.com/watch?v=apTey2Xv6b4" target="_blank">Promofilmpj</a>e tweenstalent.</p>\r\n<p class="p2">Ook hiervoor alvast onze dank namens het hele team van Tweens Talent,</p>\r\n<p class="p2">Met vriendelijke groet,</p>\r\n<p class="p2">Team Project Paspoort</p>', 'Media', '', 'inherit', 'open', 'open', '', '11-autosave-v1', '', '', '2014-07-11 14:13:54', '2014-07-11 13:13:54', '', 11, 'http://test.jessekorver.nl/11-autosave-v1/', 0, 'revision', '', 0),
(237, 2, '2014-05-28 12:41:51', '2014-05-28 11:41:51', '<p class="p1">Beste allen,</p>\r\n<p class="p2">Nogmaals erg bedankt voor jullie betrokkenheid bij de pilot-uitvoering van Tweens Talent. We hebben met dit fantastische event ruim 1000 leerlingen van 21 basisscholen kunnen inspireren en motiveren bij het ontdekken van hun talenten en het uitstippelen van het traject naar hun toekomstdroom.</p>\r\n<p class="p2">Samen zijn we een hele ervaring rijker en we hebben alle intentie volgend jaar een nog mooiere editie van Tweens Talent te realiseren.</p>\r\n<p class="p2">Er volgen deze week meerdere foto''s. Ik verwijs jullie daarom graag naar de linkÂ <span class="s1"><a href="http://facebook.com/Tweenstalent">facebook.com/Tweenstalent</a>Â </span>voor alle foto''s en filmpjes en natuurlijk ook een leuke item van gister op het jeugdjournaal!!!.</p>\r\n<p class="p2">Zie:Â <a href="http://jeugdjournaal.nl/uitzending/avond/2014-01-14"><span class="s1">http://jeugdjournaal.nl/uitzending/avond/2014-01-14</span></a></p>\r\n<p class="p2">Ook hiervoor alvast onze dank namens het hele team van Tweens Talent,</p>\r\n<p class="p2">Met vriendelijke groet,</p>\r\n<p class="p2">Team Project Paspoort</p>', 'Media', '', 'inherit', 'open', 'open', '', '11-revision-v1', '', '', '2014-05-28 12:41:51', '2014-05-28 11:41:51', '', 11, 'http://test.jessekorver.nl/11-revision-v1/', 0, 'revision', '', 0),
(238, 1, '2014-05-28 12:42:44', '2014-05-28 11:42:44', '<img class="alignnone" style="float: left;" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/ouders.png" alt="ouders" />\r\n<p class="hel2">Project paspoort en ouders</p>\r\nProject Paspoort heeft ten doel om jongeren in het primair onderwijs te helpen bij de zoektocht naar hun identiteit, talenten en kwaliteiten, om deze talenten en kwaliteiten vervolgens verder te ontwikkelen en toe te passen in de aanloop naar hun carriÃ¨reProject Paspoort speelt in op de toenemende behoefte en wensen van de jongeren om zich te identificeren met succesvolle en bekende rolmodellen.\r\n\r\nDeze behoefte vraagt om nieuwe vormen te ontwikkelen die zowel een ondersteuning als aanvulling bieden aan het bestaande onderwijsprogramma. Dit doen wij door de jongeren spelenderwijs kennis te laten maken met educatie en communicatie.\r\n\r\nProject Paspoort is een visie op talentontwikkeling waarbij op persoonlijke manier ondersteund wordt bij het ontwikkelen van je dromen. Door het gebruik van komedie en sketches in de lesmethode in combinatie met de inzet van rolmodellen welke maatschappelijk geslaagd zijn, biedt het project de jongeren een unieke kans tot zelfontplooiing.\r\n<img class="alignright" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/fietsen.png" alt="fietsen" />', 'Ouders', '', 'inherit', 'open', 'open', '', '20-revision-v1', '', '', '2014-05-28 12:42:44', '2014-05-28 11:42:44', '', 20, 'http://test.jessekorver.nl/20-revision-v1/', 0, 'revision', '', 0),
(239, 1, '2014-05-28 12:43:36', '2014-05-28 11:43:36', '<p class="hel2">Project Paspoort en de basisschool</p>\r\n<img class="alignleft" style="float: left;" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/map.png" alt="map" width="134" height="109" />Het project richt zich op leerlingen uit groep 7/8 van het basisonderwijs.Project Paspoort heeft tot doel de leerlingen te begeleiden om vanuit hun kracht en talent te leren denken en niet vanuit hun angsten, problemen of zorgen. De leerlingen onderzoeken spelenderwijs wat hun talenten zijn. Vanuit deze basis leren ze naar hun toekomstig beroep te kijken. Ze leren dat je dromen kunt verwezenlijken, als je maar de juiste stappen neemt.\r\n\r\nHet doel van het project sluit aan bij de kerndoelen van het ministerie van OC&amp;W op het gebied van de sociaal emotionele ontwikkeling. In het bijzonder bij kerndoelnummer 34: âOriÃ«ntatie op jezelf en de wereld, mens en samenleving.â Project Paspoort is een vierdelige lessenserie die speciaal is ontwikkeld voor groep 8. Een schakeljaar waarin kinderen en hun ouders voor belangrijke keuzes staan, die bepalend zijn voor de toekomst van het kind. Zij moeten erachter komen welk schooltype geschikt is voor het kind. Om deze vraag te kunnen beantwoorden, moeten de kinderen gaan nadenken over de vragen: Wie ben ik? Wat kan ik? Wat wil ik?\r\n\r\nNa de opening van de les door een bekende gastdocent, gaat de reguliere docente twee weken verder met het thema. In de tussenliggende weken kunnen de schooldocenten ter verdieping met de leerlingen extra opdrachten uitvoeren.', 'Scholen', '', 'inherit', 'open', 'open', '', '61-revision-v1', '', '', '2014-05-28 12:43:36', '2014-05-28 11:43:36', '', 61, 'http://test.jessekorver.nl/61-revision-v1/', 0, 'revision', '', 0),
