(241, 2, '2014-05-28 12:52:14', '2014-05-28 11:52:14', '<p class="p1">Beste allen,</p>\r\n<p class="p2">Nogmaals erg bedankt voor jullie betrokkenheid bij de pilot-uitvoering van Tweens Talent. We hebben met dit fantastische event ruim 1000 leerlingen van 21 basisscholen kunnen inspireren en motiveren bij het ontdekken van hun talenten en het uitstippelen van het traject naar hun toekomstdroom.</p>\r\n<p class="p2">Samen zijn we een hele ervaring rijker en we hebben alle intentie volgend jaar een nog mooiere editie van Tweens Talent te realiseren.</p>\r\n<p class="p2">Er volgen deze week meerdere foto''s. Ik verwijs jullie daarom graag naar de linkÂ <span class="s1"><a href="http://facebook.com/Tweenstalent">facebook.com/Tweenstalent</a>Â </span>voor alle foto''s en filmpjes en natuurlijk ook een leuke item van gister op het jeugdjournaal!!!.</p>\r\n<p class="p2">Zie:Â <a href="http://jeugdjournaal.nl/uitzending/avond/2014-01-14"><span class="s1">http://jeugdjournaal.nl/uitzending/avond/2014-01-14</span></a></p>\r\n<p class="p2">Ook hiervoor alvast onze dank namens het hele team van Tweens Talent,</p>\r\n<p class="p2">Met vriendelijke groet,</p>\r\n<p class="p2">Team Project Paspoort</p>', 'Media', '', 'inherit', 'open', 'open', '', '11-revision-v1', '', '', '2014-05-28 12:52:14', '2014-05-28 11:52:14', '', 11, 'http://test.jessekorver.nl/11-revision-v1/', 0, 'revision', '', 0),
(242, 1, '2014-05-28 13:03:51', '2014-05-28 12:03:51', '<img class="alignnone" style="float: left;" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/aardbol.png" alt="aardbol" />\r\n<h3>Project paspoort en investeerders</h3>\r\nProject Paspoort heeft ten doel om jongeren in het primair onderwijs te helpen bij de zoektocht naar hun identiteit, talenten en kwaliteiten, om deze talenten en kwaliteiten vervolgens verder te ontwikkelen en toe te passen in de aanloop naar hun carriÃ¨reProject Paspoort speelt in op de toenemende behoefte en wensen van de jongeren om zich te identificeren met succesvolle en bekende rolmodellen.\r\n\r\nDeze behoefte vraagt om nieuwe vormen te ontwikkelen die zowel een ondersteuning als aanvulling bieden aan het bestaande onderwijsprogramma. Dit doen wij door de jongeren spelenderwijs kennis te laten maken met educatie en communicatie.\r\n\r\nProject Paspoort is een visie op talentontwikkeling waarbij op persoonlijke manier ondersteund wordt bij het ontwikkelen van je dromen. Door het gebruik van komedie en sketches in de lesmethode in combinatie met de inzet van rolmodellen welke maatschappelijk geslaagd zijn, biedt het project de jongeren een unieke kans tot zelfontplooiing.\r\n\r\n<img class="alignright" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/busje.png" alt="busje" />', 'Bedrijven', '', 'inherit', 'open', 'open', '', '64-revision-v1', '', '', '2014-05-28 13:03:51', '2014-05-28 12:03:51', '', 64, 'http://test.jessekorver.nl/64-revision-v1/', 0, 'revision', '', 0),
(243, 1, '2014-05-28 13:04:18', '2014-05-28 12:04:18', '<img class="alignnone" style="float: left;" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/aardbol.png" alt="aardbol" />\r\n<h3>Project paspoort en investeerders</h3>\r\nProject Paspoort heeft ten doel om jongeren in het primair onderwijs te helpen bij de zoektocht naar hun identiteit, talenten en kwaliteiten, om deze talenten en kwaliteiten vervolgens verder te ontwikkelen en toe te passen in de aanloop naar hun carriÃ¨reProject Paspoort speelt in op de toenemende behoefte en wensen van de jongeren om zich te identificeren met succesvolle en bekende rolmodellen.\r\n\r\nDeze behoefte vraagt om nieuwe vormen te ontwikkelen die zowel een ondersteuning als aanvulling bieden aan het bestaande onderwijsprogramma. Dit doen wij door de jongeren spelenderwijs kennis te laten maken met educatie en communicatie.\r\n\r\nProject Paspoort is een visie op talentontwikkeling waarbij op persoonlijke manier ondersteund wordt bij het ontwikkelen van je dromen. Door het gebruik van komedie en sketches in de lesmethode in combinatie met de inzet van rolmodellen welke maatschappelijk geslaagd zijn, biedt het project de jongeren een unieke kans tot zelfontplooiing.\r\n\r\n<img class="alignright" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/busje.png" alt="busje" />', 'Bedrijven', '', 'inherit', 'open', 'open', '', '64-revision-v1', '', '', '2014-05-28 13:04:18', '2014-05-28 12:04:18', '', 64, 'http://test.jessekorver.nl/64-revision-v1/', 0, 'revision', '', 0),
