(255, 1, '2014-05-28 13:29:35', '2014-05-28 12:29:35', '<p style="color: #526567;"><strong>Missie</strong>\r\nLeerlingen in het basis onderwijs weerbaarder te maken door hen handvatten te bieden om hun dromen te verwezenlijken en (meer) bewust te maken van hun toekomstmogelijkheden en hen te stimuleren deze dromen waar te maken.</p>\r\n<p style="color: #526567;"><strong>Visie</strong>\r\nProject Paspoort wil de jongeren helpen bij het maken van de juiste keuzes en ze voor te bereiden op hun vervolgopleiding door het inzetten van succesvolle rolmodellen.</p>\r\n<p style="color: #526567;"><strong>Marketingstrategie Project Paspoort</strong></p>\r\n<p style="color: #526567;">Project Paspoort heeft ten doel om jongeren in het primair onderwijs te helpen bij de zoektocht naar hun identiteit, talenten en kwaliteiten, om deze talenten en kwaliteiten vervolgens verder te ontwikkelen en toe te passen in de aanloop naar hun carriÃ¨re.</p>\r\n<p style="color: #526567;">Project Paspoort speelt in op de toenemende behoefte en wensen van de jongeren om zich te identificeren met succesvolle en bekende rolmodellen. Deze behoefte vraagt om nieuwe vormen te ontwikkelen die zowel een ondersteuning als aanvulling bieden aan het bestaande onderwijsprogramma. Dit doen wij door de jongeren spelenderwijs kennis te laten maken met educatie en communicatie.</p>\r\n<p style="color: #526567;">Daarnaast richten wij op het verbeteren van de maatschappelijke positie van jongeren in Amsterdam. Wij willen met onze fysieke aanwezigheid in Amsterdam Nieuw West een positieve bijdrage leveren en dicht bij onze doelgroep aan de slag gaan.</p>\r\n<p style="color: #526567;"><strong>Waarmee onderscheidt Project Paspoort zich van gelijke projecten?</strong></p>\r\n<p style="color: #526567;">Project Paspoort is een visie op talentontwikkeling waarbij op persoonlijke manier ondersteund wordt bij het ontwikkelen van je dromen. Door het gebruik van komedie en sketches in de lesmethode in combinatie met de inzet van rolmodellen welke maatschappelijk geslaagd zijn, biedt het project de jongeren een unieke kans tot zelfontplooiing.</p>\r\n<p style="color: #526567;">Dit doen we door begeleiding, kennisdeling en ondersteuning om de jongeren bewust te maken van hun toekomstmogelijkheden en hen te stimuleren deze mogelijkheden ook waar te maken. De combinatie maakt dat het project aanslaat bij de jongeren.</p>\r\n<p style="color: #526567;"><strong>Omschrijving producten Project Paspoort</strong></p>\r\n<p style="color: #526567;">Wij leveren als project Paspoort een gevarieerd aanbod aan educatie middels werkboekjes voor de leerlingen, docentenhandleiding, diverse gadgets voor de leerlingen en door gebruik te maken van een interactieve website.</p>\r\n<p style="color: #526567;"><strong>Personeelsbeleid</strong></p>\r\n<p style="color: #526567;">Binnen de organisatie zijn er verschillende academische disciplines vertegenwoordigd. En bestaat uit 3 vaste krachten en een groot netwerk van freelancers die op specialistische onderdelen worden ingezet.</p>\r\n<p style="color: #526567;"><strong>Op welke wijze, economisch en maatschappelijk, is Project Paspoort belangrijk voor de buurt?</strong></p>\r\n<p style="color: #526567;">Economisch\r\nâ¢Â Â  Â Vestiging in de buurt.\r\nâ¢Â Â  Â Aantrekken personeelsleden uit de directe omgeving.\r\nâ¢Â Â  Â Het creÃ«ren van een positief imago door als uithangbord van Amsterdam te fungeren.</p>\r\n<p style="color: #526567;">Maatschappelijk\r\nâ¢Â Â  Â Betrokkenheid van ouders, jongeren, stadsdelen, onderwijsinstellingen en lokale bedrijven bij het organiseren van evenementen.\r\nâ¢Â Â  Â CreÃ«ren van uitdagende leef- en schoolomgeving.</p>', 'Over ons', '', 'inherit', 'open', 'open', '', '232-revision-v1', '', '', '2014-05-28 13:29:35', '2014-05-28 12:29:35', '', 232, 'http://test.jessekorver.nl/232-revision-v1/', 0, 'revision', '', 0),
