(264, 2, '2014-05-30 13:32:53', '2014-05-30 12:32:53', '<img class="alignleft" style="float: left;" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/map.png" alt="map" width="134" height="109" />Het project richt zich op leerlingen uit groep 7/8 van het basisonderwijs. Project Paspoort heeft tot doel de leerlingen te begeleiden om vanuit hun kracht en talent te leren denken en niet vanuit hun angsten, problemen of zorgen. De leerlingen onderzoeken spelenderwijs wat hun talenten zijn. Vanuit deze basis leren ze naar hun toekomstig beroep te kijken. Ze leren dat je dromen kunt verwezenlijken, als je maar de juiste stappen neemt.\n\nHet doel van het project sluit aan bij de kerndoelen van het ministerie van OC&amp;W op het gebied van de sociaal emotionele ontwikkeling. In het bijzonder bij kerndoelnummer 34: âOriÃ«ntatie op jezelf en de wereld, mens en samenleving.â Project Paspoort is een vierdelige lessenserie die speciaal is ontwikkeld voor groep 8. Een schakeljaar waarin kinderen en hun ouders voor belangrijke keuzes staan, die bepalend zijn voor de toekomst van het kind. Zij moeten erachter komen welk schooltype geschikt is voor het kind. Om deze vraag te kunnen beantwoorden, moeten de kinderen gaan nadenken over de vragen: Wie ben ik? Wat kan ik? Wat wil ik?\n\nNa de opening van de les door een bekende gastdocent, gaat de reguliere docente twee weken verder met het thema. In de tussenliggende weken kunnen de schooldocenten ter verdieping met de leerlingen extra opdrachten uitvoeren.\n\nZie docentenhandleiding voor meer info:Â <a href="http://www.projectpaspoort.nl/projecten/scholen/docentenhandleiding/" rel="attachment wp-att-265">docentenhandleiding</a>', 'Scholen', '', 'inherit', 'open', 'open', '', '61-autosave-v1', '', '', '2014-05-30 13:32:53', '2014-05-30 12:32:53', '', 61, 'http://www.projectpaspoort.nl/61-autosave-v1/', 0, 'revision', '', 0),
