(273, 1, '2014-06-01 11:48:24', '2014-06-01 10:48:24', '<img class="alignleft" style="float: left;" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/ouders.png" alt="ouders" width="160" height="155" />\r\n\r\nDoel van de ouderbijeenkomsten is om ouders kennis te laten nemen van de werkwijze van het project en de projectdoelen en hun bewust te maken van hun eigen rol ten aanzien van de gestelde projectdoelen. De gastdocent geeft op de bijeenkomst een powerpoint presentatie en gaat met de ouders in gesprek over het project en hun kinderen. Waar gewenst zal de ouders ook ondersteuning worden geboden bij hun opvoedingsvragen.\r\n\r\n<img class="alignright" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/fietsen.png" alt="fietsen" />', 'Ouders', '', 'inherit', 'open', 'open', '', '20-revision-v1', '', '', '2014-06-01 11:48:24', '2014-06-01 10:48:24', '', 20, 'http://www.projectpaspoort.nl/20-revision-v1/', 0, 'revision', '', 0),
(270, 2, '2014-05-31 09:25:14', '2014-05-31 08:25:14', '<img class="alignnone" style="float: left;" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/ouders.png" alt="ouders" />\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\nDoel van de ouderbijeenkomsten is om ouders kennis te laten nemen van de werkwijze van het project en de projectdoelen en hun bewust te maken van hun eigen rol ten aanzien van de gestelde projectdoelen. De gastdocent geeft op de bijeenkomst een powerpoint presentatie en gaat met de ouders in gesprek over het project en hun kinderen. Waar gewenst zal de ouders ook ondersteuning worden geboden bij hun opvoedingsvragen. <img class="alignright" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/fietsen.png" alt="fietsen" />', 'Ouders', '', 'inherit', 'open', 'open', '', '20-revision-v1', '', '', '2014-05-31 09:25:14', '2014-05-31 08:25:14', '', 20, 'http://www.projectpaspoort.nl/20-revision-v1/', 0, 'revision', '', 0),
