(301, 2, '2014-06-04 08:31:03', '2014-06-04 07:31:03', '<p style="color: #526567;"><strong>Missie</strong>\r\nLeerlingen in het basis onderwijs weerbaarder te maken door hen handvatten te bieden om hun dromen te verwezenlijken en (meer) bewust te maken van hun toekomstmogelijkheden en hen te stimuleren deze dromen waar te maken.</p>\r\n<p style="color: #526567;"><strong>Visie</strong>\r\nProject Paspoort wil de jongeren helpen bij het maken van de juiste keuzes en ze voor te bereiden op hun vervolgopleiding door het inzetten van succesvolle rolmodellen.</p>\r\n\r\n<div class="exp-col-content-holder"><a class="expand-cnt-link" href="#">lees verder </a>\r\n<div class="hidden-content">\r\n<p class="hiddenContentp">Marketingstrategie Project Paspoort Project Paspoort heeft ten doel om jongeren in het primair onderwijs te helpen bij de zoektocht naar hun identiteit, talenten en kwaliteiten, om deze talenten en kwaliteiten vervolgens verder te ontwikkelen en toe te passen in de aanloop naar hun carriÃ¨re. Project Paspoort speelt in op de toenemende behoefte en wensen van de jongeren om zich te identificeren met succesvolle en bekende rolmodellen. Deze behoefte vraagt om nieuwe vormen te ontwikkelen die zowel een ondersteuning als aanvulling bieden aan het bestaande onderwijsprogramma. Dit doen wij door de jongeren spelenderwijs kennis te laten maken met educatie en communicatie. Daarnaast richten wij op het verbeteren van de maatschappelijke positie van jongeren in Amsterdam. Wij willen met onze fysieke aanwezigheid in Amsterdam Nieuw West een positieve bijdrage leveren en dicht bij onze doelgroep aan de slag gaan. Waarmee onderscheidt Project Paspoort zich van gelijke projecten? Project Paspoort is een visie op talentontwikkeling waarbij op persoonlijke manier ondersteund wordt bij het ontwikkelen van je dromen. Door het gebruik van komedie en sketches in de lesmethode in combinatie met de inzet van rolmodellen welke maatschappelijk geslaagd zijn, biedt het project de jongeren een unieke kans tot zelfontplooiing. Dit doen we door begeleiding, kennisdeling en ondersteuning om de jongeren bewust te maken van hun toekomstmogelijkheden en hen te stimuleren deze mogelijkheden ook waar te maken. De combinatie maakt dat het project aanslaat bij de jongeren. Omschrijving producten Project Paspoort Wij leveren als project Paspoort een gevarieerd aanbod aan educatie middels werkboekjes voor de leerlingen, docentenhandleiding, diverse gadgets voor de leerlingen en door gebruik te maken van een interactieve website. Personeelsbeleid Binnen de organisatie zijn er verschillende academische disciplines vertegenwoordigd. En bestaat uit 3 vaste krachten en een groot netwerk van freelancers die op specialistische onderdelen worden ingezet. Op welke wijze, economisch en maatschappelijk, is Project Paspoort belangrijk voor de buurt? Vestiging in de buurt. â¢ Aantrekken personeelsleden uit de directe omgeving. â¢ Het creÃ«ren van een positief imago door als uithangbord van Amsterdam te fungeren. Maatschappelijk â¢ Betrokkenheid van ouders, jongeren, stadsdelen, onderwijsinstellingen en lokale bedrijven bij het organiseren van evenementen. â¢ CreÃ«ren van uitdagende leef- en schoolomgeving.</p>\r\n\r\n</div>\r\n</div>\r\n<p style="color: #526567;"></p>\r\n&nbsp;\r\n<p style="color: #526567;"></p>', 'Over ons', '', 'inherit', 'open', 'open', '', '232-autosave-v1', '', '', '2014-06-04 08:31:03', '2014-06-04 07:31:03', '', 232, 'http://www.projectpaspoort.nl/232-autosave-v1/', 0, 'revision', '', 0),
(304, 2, '2014-06-04 09:00:29', '2014-06-04 08:00:29', '', 'koffer', '', 'inherit', 'open', 'open', '', 'koffer', '', '', '2014-06-04 09:00:29', '2014-06-04 08:00:29', '', 2, 'http://www.projectpaspoort.nl/wp-content/uploads/2014/04/koffer.jpg', 0, 'attachment', 'image/jpeg', 0),
(305, 2, '2014-06-04 09:01:40', '2014-06-04 08:01:40', '<img class="alignnone" style="float: right;" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/logo-site-transparent.png" alt="Paspoort naar je toekomstdroom" />\r\n<p style="color: #526567;">Stichting Paspoort naar Â je toekomstdroom, heeft tot doel de leerlingen te begeleiden om vanuit hun kracht en talent te leren denken en niet vanuit hun angsten, problemen of zorgen. De leerlingen onderzoeken spelenderwijs wat hun talenten zijn. Vanuit deze basis leren ze naar hun toekomstige beroep te kijken. Ze leren dat je dromen kunt verwezenlijken, als je maar de juiste stappen neemt.</p>\r\n<p style="color: #526567;">Stichting Paspoort naar Â je toekomstdroom, speelt in op de toenemende behoefte en wensen van de jongeren om zich te identificeren met succesvolle en bekende rolmodellen. Deze behoefte vraagt om nieuwe vormen te ontwikkelen die zowel een ondersteuning als aanvulling bieden aan het bestaande onderwijsprogramma. Dit doen wij door de jongeren spelenderwijs kennis te laten maken met educatie en communicatie.</p>\r\n<p style="color: #526567;"><!--more-->eerste stap naar een succesvolle toekomst is de juiste schoolkeuze. Om uit te vinden welk schooltype bij hen past, moeten de leerlingen nadenken over vragen als: Wie ben ik? Wat kan ik? Wat wil ik? âHet project "Paspoort naar je toekomstdroomâ , faciliteert de leerlingen en de docent hierbij. De rolmodellen uit de TV-,film en sportwereld, die de workshops samen met de docent geven, stimuleren de jongeren extra om serieus met hun toekomst aan de slag te gaan.</p>', 'Home', '', 'inherit', 'open', 'open', '', '2-revision-v1', '', '', '2014-06-04 09:01:40', '2014-06-04 08:01:40', '', 2, 'http://www.projectpaspoort.nl/2-revision-v1/', 0, 'revision', '', 0),
