(329, 2, '2014-07-11 14:13:39', '2014-07-11 13:13:39', '<p class="p1">Beste allen,</p>\r\n<p class="p2">Nogmaals erg bedankt voor jullie betrokkenheid bij de pilot-uitvoering van Tweens Talent. We hebben met dit fantastische event ruim 1000 leerlingen van 21 basisscholen kunnen inspireren en motiveren bij het ontdekken van hun talenten en het uitstippelen van het traject naar hun toekomstdroom.</p>\r\n<p class="p2">Samen zijn we een hele ervaring rijker en we hebben alle intentie volgend jaar een nog mooiere editie van Tweens Talent te realiseren.</p>\r\n<p class="p2">Er volgen deze week meerdere foto''s. Ik verwijs jullie daarom graag naar de linkÂ <span class="s1"><a href="http://facebook.com/Tweenstalent">facebook.com/Tweenstalent</a>Â </span>voor alle foto''s en filmpjes en natuurlijk ook een leuke item van gister op het<a title="jeugdjournaal" href="%20http://jeugdjournaal.nl/uitzending/avond/2014-01-14" target="_blank"> jeugdjournaal!!!.</a></p>\r\n<p class="p2">Zie:Â <a href="http://jeugdjournaal.nl/uitzending/avond/2014-01-14"><span class="s1">http://jeugdjournaal.nl/uitzending/avond/2014-01-14</span></a></p>\r\n<p class="p2">Zie ook:Â <a title="tweenstalent promo" href="https://www.youtube.com/watch?v=apTey2Xv6b4" target="_blank">Promofilmpj</a>e tweenstalent.</p>\r\n<p class="p2">Ook hiervoor alvast onze dank namens het hele team van Tweens Talent,</p>\r\n<p class="p2">Met vriendelijke groet,</p>\r\n<p class="p2">Team Project Paspoort</p>', 'Media', '', 'inherit', 'open', 'open', '', '11-revision-v1', '', '', '2014-07-11 14:13:39', '2014-07-11 13:13:39', '', 11, 'http://www.projectpaspoort.nl/11-revision-v1/', 0, 'revision', '', 0),
