(331, 2, '2014-07-11 15:17:28', '2014-07-11 14:17:28', '<strong>Ook meedoen?</strong>\r\n\r\nWilt u als school ook deelnemen aan het project âPaspoort naar je Toekomstdroom?\r\nOf wilt u meer informatie ontvangen over de lessen, neem dan contact met ons op.\r\n<p style="text-align: left;"><span style="font-size: 13px;">Stichting Project Paspoort\r\n</span>Meer en Vaart 116\r\n<span style="font-size: 13px;">1068 ZZ Amsterdam</span></p>\r\nContactpersoon: Mohamed Chaara\r\nMâobiel: 06 1444 234 6\r\nE-mail: âÂ <a href="mailto:%E2%80%8Bmo@projectpaspoort.nl">mo@projectpaspoort.nl\r\n</a>\r\n\r\nK.v.k.: 34382778\r\nB.t.w.: 822064959B01', 'Contact', '', 'inherit', 'open', 'open', '', '9-revision-v1', '', '', '2014-07-11 15:17:28', '2014-07-11 14:17:28', '', 9, 'http://www.projectpaspoort.nl/9-revision-v1/', 0, 'revision', '', 0),
(332, 2, '2014-11-12 20:33:58', '2014-11-12 19:33:58', '<img class="alignnone" style="float: right;" src="http://www.projectpaspoort.nl/wp-content/uploads/2014/10/logo-site-transparent.png" alt="Paspoort naar je toekomstdroom" />\r\n<p style="color: #526567;">Stichting Paspoort naar Â je toekomstdroom, heeft tot doel de leerlingen te begeleiden om vanuit hun kracht en talent te leren denken en niet vanuit hun angsten, problemen of zorgen. De leerlingen onderzoeken spelenderwijs wat hun talenten zijn. Vanuit deze basis leren ze naar hun toekomstige beroep te kijken. Ze leren dat je dromen kunt verwezenlijken, als je maar de juiste stappen neemt.</p>\r\n<p style="color: #526567;">Stichting Paspoort naar Â je toekomstdroom, speelt in op de toenemende behoefte en wensen van de jongeren om zich te identificeren met succesvolle en bekende rolmodellen. Deze behoefte vraagt om nieuwe vormen te ontwikkelen die zowel een ondersteuning als aanvulling bieden aan het bestaande onderwijsprogramma. Dit doen wij door de jongeren spelenderwijs kennis te laten maken met educatie en communicatie.</p>\r\n<p style="color: #526567;"><!--more-->eerste stap naar een succesvolle toekomst is de juiste schoolkeuze. Om uit te vinden welk schooltype bij hen past, moeten de leerlingen nadenken over vragen als: Wie ben ik? Wat kan ik? Wat wil ik? âHet project "Paspoort naar je toekomstdroomâ , faciliteert de leerlingen en de docent hierbij. De rolmodellen uit de TV-,film en sportwereld, die de workshops samen met de docent geven, stimuleren de jongeren extra om serieus met hun toekomst aan de slag te gaan.</p>', 'Home', '', 'inherit', 'open', 'open', '', '2-autosave-v1', '', '', '2014-11-12 20:33:58', '2014-11-12 19:33:58', '', 2, 'http://www.projectpaspoort.nl/2-autosave-v1/', 0, 'revision', '', 0),
(347, 1, '2014-10-17 12:14:41', '2014-10-17 11:14:41', '<p style="color: #526567;"><strong>Missie</strong>\nLeerlingen in het basis onderwijs weerbaarder te maken door hen handvatten te bieden om hun dromen te verwezenlijken en (meer) bewust te maken van hun toekomstmogelijkheden en hen te stimuleren deze dromen waar te maken.</p>\n<p style="color: #526567;"><strong>Visie</strong>\nProject Paspoort wil de jongeren helpen bij het maken van de juiste keuzes en ze voor te bereiden op hun vervolgopleiding door het inzetten van succesvolle rolmodellen.</p>\n\n<div class="exp-col-content-holder"><a class="expand-cnt-link" href="#">lees verder</a>\n<div class="hidden-content">\n<p class="hiddenContentp">Marketingstrategie Project Paspoort Project Paspoort heeft ten doel om jongeren in het primair onderwijs te helpen bij de zoektocht naar hun identiteit, talenten en kwaliteiten, om deze talenten en kwaliteiten vervolgens verder te ontwikkelen en toe te passen in de aanloop naar hun carriÃ¨re.</p>\n\n<p>Project Paspoort speelt in op de toenemende behoefte en wensen van de jongeren om zich te identificeren met succesvolle en bekende rolmodellen. Deze behoefte vraagt om nieuwe vormen te ontwikkelen die zowel een ondersteuning als aanvulling bieden aan het bestaande onderwijsprogramma. Dit doen wij door de jongeren spelenderwijs kennis te laten maken met educatie en communicatie. Daarnaast richten wij op het verbeteren van de maatschappelijke positie van jongeren in Amsterdam.</p>\n\n<p>Wij willen met onze fysieke aanwezigheid in Amsterdam Nieuw West een positieve bijdrage leveren en dicht bij onze doelgroep aan de slag gaan. Waarmee onderscheidt Project Paspoort zich van gelijke projecten? Project Paspoort is een visie op talentontwikkeling waarbij op persoonlijke manier ondersteund wordt bij het ontwikkelen van je dromen.</p>\n\n<p>Door het gebruik van komedie en sketches in de lesmethode in combinatie met de inzet van rolmodellen welke maatschappelijk geslaagd zijn, biedt het project de jongeren een unieke kans tot zelfontplooiing. Dit doen we door begeleiding, kennisdeling en ondersteuning om de jongeren bewust te maken van hun toekomstmogelijkheden en hen te stimuleren deze mogelijkheden ook waar te maken. De combinatie maakt dat het project aanslaat bij de jongeren.</p>\n\n<p><strong>Omschrijving producten Project Paspoort</strong></p>\n\n<p>Wij leveren als project Paspoort een gevarieerd aanbod aan educatie middels werkboekjes voor de leerlingen, docentenhandleiding, diverse gadgets voor de leerlingen en door gebruik te maken van een interactieve website.</p>\n\n<p><strong>Personeelsbeleid</strong></p>\n\n<p>Binnen de organisatie zijn er verschillende academische disciplines vertegenwoordigd. En bestaat uit 3 vaste krachten en een groot netwerk van freelancers die op specialistische onderdelen worden ingezet.</p>\n<p><strong>Op welke wijze, economisch en maatschappelijk, is Project Paspoort belangrijk voor de buurt?</strong></p>\n<p>Vestiging in de buurt. â¢ Aantrekken personeelsleden uit de directe omgeving. â¢ Het creÃ«ren van een positief imago door als uithangbord van Amsterdam te fungeren. Maatschappelijk â¢ Betrokkenheid van ouders, jongeren, stadsdelen, onderwijsinstellingen en lokale bedrijven bij het organiseren van evenementen. â¢ CreÃ«ren van uitdagende leef- en schoolomgeving.</p>\n\n</div>\n</div>\n\n\n\n', 'Over ons', '', 'inherit', 'open', 'open', '', '232-autosave-v1', '', '', '2014-10-17 12:14:41', '2014-10-17 11:14:41', '', 232, 'http://www.projectpaspoort.nl/232-autosave-v1/', 0, 'revision', '', 0),
