(362, 1, '2014-10-17 13:22:23', '2014-10-17 12:22:23', '<div class="large-12 columns space hoek paspoort">\r\nHet project richt zich op leerlingen uit groep 7/8 van het basisonderwijs. Project Paspoort heeft tot doel de leerlingen te begeleiden om vanuit hun kracht en talent te leren denken en niet vanuit hun angsten, problemen of zorgen. De leerlingen onderzoeken spelenderwijs wat hun talenten zijn. Vanuit deze basis leren ze naar hun toekomstig beroep te kijken. Ze leren dat je dromen kunt verwezenlijken, als je maar de juiste stappen neemt. Het doel van het project sluit aan bij de kerndoelen van het ministerie van OC&amp;W op het gebied van de sociaal emotionele ontwikkeling. In het bijzonder bij kerndoelnummer 34: âOriÃ«ntatie op jezelf en de wereld, mens en samenleving.â Project Paspoort is een vierdelige lessenserie die speciaal is ontwikkeld voor groep 8. Een schakeljaar waarin kinderen en hun ouders voor belangrijke keuzes staan, die bepalend zijn voor de toekomst van het kind. Zij moeten erachter komen welk schooltype geschikt is voor het kind. Om deze vraag te kunnen beantwoorden, moeten de kinderen gaan nadenken over de vragen: Wie ben ik? Wat kan ik? Wat wil ik? Na de opening van de les door een bekende gastdocent, gaat de reguliere docente twee weken verder met het thema. In de tussenliggende weken kunnen de schooldocenten ter verdieping met de leerlingen extra opdrachten uitvoeren. Zie docentenhandleiding voor meer info:Â <a href="http://www.projectpaspoort.nl/wp-content/uploads/2014/04/docentenhandleiding.pdf">docentenhandleiding</a>\r\n</div>', 'Scholen', '', 'inherit', 'open', 'open', '', '61-revision-v1', '', '', '2014-10-17 13:22:23', '2014-10-17 12:22:23', '', 61, 'http://www.projectpaspoort.nl/61-revision-v1/', 0, 'revision', '', 0),
(363, 1, '2014-10-17 13:22:52', '2014-10-17 12:22:52', '<div class="large-12 columns space hoek paspoort">\r\n<p>\r\nHet project richt zich op leerlingen uit groep 7/8 van het basisonderwijs. Project Paspoort heeft tot doel de leerlingen te begeleiden om vanuit hun kracht en talent te leren denken en niet vanuit hun angsten, problemen of zorgen. De leerlingen onderzoeken spelenderwijs wat hun talenten zijn. Vanuit deze basis leren ze naar hun toekomstig beroep te kijken. Ze leren dat je dromen kunt verwezenlijken, als je maar de juiste stappen neemt. Het doel van het project sluit aan bij de kerndoelen van het ministerie van OC&amp;W op het gebied van de sociaal emotionele ontwikkeling. In het bijzonder bij kerndoelnummer 34: âOriÃ«ntatie op jezelf en de wereld, mens en samenleving.â Project Paspoort is een vierdelige lessenserie die speciaal is ontwikkeld voor groep 8. Een schakeljaar waarin kinderen en hun ouders voor belangrijke keuzes staan, die bepalend zijn voor de toekomst van het kind. Zij moeten erachter komen welk schooltype geschikt is voor het kind. Om deze vraag te kunnen beantwoorden, moeten de kinderen gaan nadenken over de vragen: Wie ben ik? Wat kan ik? Wat wil ik? Na de opening van de les door een bekende gastdocent, gaat de reguliere docente twee weken verder met het thema. In de tussenliggende weken kunnen de schooldocenten ter verdieping met de leerlingen extra opdrachten uitvoeren. Zie docentenhandleiding voor meer info:Â <a href="http://www.projectpaspoort.nl/wp-content/uploads/2014/04/docentenhandleiding.pdf">docentenhandleiding</a></p>\r\n</div>', 'Scholen', '', 'inherit', 'open', 'open', '', '61-revision-v1', '', '', '2014-10-17 13:22:52', '2014-10-17 12:22:52', '', 61, 'http://www.projectpaspoort.nl/61-revision-v1/', 0, 'revision', '', 0),
(364, 1, '2014-10-17 13:27:30', '2014-10-17 12:27:30', '<div class="large-12 columns space hoek paspoort">\r\n<h3>Paspoort naar je toekomstdroom</h3>\r\n<p>Project Paspoort heeft tot doel de leerlingen te begeleiden om vanuit hun kracht en talent te leren denken en niet vanuit hun angsten, problemen of zorgen. De leerlingen onderzoeken spelenderwijs wat hun talenten zijn. Vanuit deze basis leren ze naar hun toekomstig beroep te kijken. Ze leren dat je dromen kunt verwezenlijken, als je maar de juiste stappen neemt.</p>\r\n\r\nProject Paspoort speelt in op de toenemende behoefte en wensen van de jongeren om zich te identificeren met succesvolle en bekende rolmodellen. Deze behoefte vraagt om nieuwe vormen te ontwikkelen die zowel een ondersteuning als aanvulling bieden aan het bestaande onderwijsprogramma. Dit doen wij door de jongeren spelenderwijs kennis te laten maken met educatie en communicatie.\r\n</div>\r\n\r\n<div class="large-12 columns space hoek paspoort">\r\n<h3>Onstaan</h3>\r\n<p>Het idee voor Project Paspoort is in 2006 ontstaan nadat jongeren uit Amsterdam Nieuw West in gesprekken met medewerkers van het Team Leerplicht aangaven dat zij voor hun jongere broers en zussen een betere toekomst wensten en hier graag zelf aan bij zouden willen dragen.</p>\r\n<p>Mohamed Chaara, acteur van Marokkaanse komaf die een hoofdrol speelde in kaskrakers als Shouf Shouf Habibi en het Schnitzelparadijs, heeft deze uitdaging opgepakt. Hij startte met een aantal proeflessen op basisscholen in Amsterdam Osdorp. Doordat leerlingen zich konden identificeren met het levensverhaal van Mohamed Chaara en de andere acteurs en doordat de rolmodellen theatertechnieken inzetten als instrument ontstond er een sfeer van vertrouwen en contact waarin de jongeren bereid waren na te denken over wie ze zijn, waar ze goed in waren en hoe ze deze talenten verder konden ontwikkelen.</p>\r\n<p>Het project levert daarmee concrete bijdrage aan het jeugdbeleid.</p>\r\n<p>De reacties van docenten en leerlingen op deze vijf proeflessen waren zeer positief. Na een eveneens zeer positieve externe evaluatie van het project, besloten Stadsdeel Osdorp en Koers Nieuw West het project ook op andere scholen in Amsterdam Nieuw-West te laten starten. Inmiddels wordt het project uitgevoerd op meer dan 100 scholen in de randstad.</p>\r\n</div>\r\n', 'Project Paspoort         ', '', 'inherit', 'open', 'open', '', '45-revision-v1', '', '', '2014-10-17 13:27:30', '2014-10-17 12:27:30', '', 45, 'http://www.projectpaspoort.nl/45-revision-v1/', 0, 'revision', '', 0);
