(371, 1, '2014-10-20 09:29:51', '2014-10-20 08:29:51', '', 'ouders', '', 'inherit', 'open', 'open', '', 'ouders-3', '', '', '2014-10-20 09:29:51', '2014-10-20 08:29:51', '', 20, 'http://www.projectpaspoort.nl/wp-content/uploads/2014/10/ouders.png', 0, 'attachment', 'image/png', 0),
(372, 1, '2014-10-20 09:30:44', '2014-10-20 08:30:44', '<img class="alignleft" style="float: left;" src="http://www.projectpaspoort.nl/?attachment_id=371 " alt="ouders" width="160" height="155" />\r\n\r\nDoel van de ouderbijeenkomsten is om ouders kennis te laten nemen van de werkwijze van het project en de projectdoelen en hun bewust te maken van hun eigen rol ten aanzien van de gestelde projectdoelen. De gastdocent geeft op de bijeenkomst een powerpoint presentatie en gaat met de ouders in gesprek over het project en hun kinderen. Waar gewenst zal de ouders ook ondersteuning worden geboden bij hun opvoedingsvragen.\r\n\r\n<img class="alignright" src="http://test.jessekorver.nl/wp-content/uploads/2014/04/fietsen.png" alt="fietsen" />', 'Ouders', '', 'inherit', 'open', 'open', '', '20-revision-v1', '', '', '2014-10-20 09:30:44', '2014-10-20 08:30:44', '', 20, 'http://www.projectpaspoort.nl/20-revision-v1/', 0, 'revision', '', 0),
