(383, 1, '2014-10-20 10:33:57', '2014-10-20 09:33:57', '<img class="alignnone" style="float: right;" src="http://www.projectpaspoort.nl/wp-content/uploads/2014/10/logo-site-transparent.png" alt="Paspoort naar je toekomstdroom" />\r\n<p style="color: #526567;">Stichting Paspoort naar Â je toekomstdroom, heeft tot doel de leerlingen te begeleiden om vanuit hun kracht en talent te leren denken en niet vanuit hun angsten, problemen of zorgen. De leerlingen onderzoeken spelenderwijs wat hun talenten zijn. Vanuit deze basis leren ze naar hun toekomstige beroep te kijken. Ze leren dat je dromen kunt verwezenlijken, als je maar de juiste stappen neemt.</p>\r\n<p style="color: #526567;">Stichting Paspoort naar Â je toekomstdroom, speelt in op de toenemende behoefte en wensen van de jongeren om zich te identificeren met succesvolle en bekende rolmodellen. Deze behoefte vraagt om nieuwe vormen te ontwikkelen die zowel een ondersteuning als aanvulling bieden aan het bestaande onderwijsprogramma. Dit doen wij door de jongeren spelenderwijs kennis te laten maken met educatie en communicatie.</p>\r\n<p style="color: #526567;"><!--more-->eerste stap naar een succesvolle toekomst is de juiste schoolkeuze. Om uit te vinden welk schooltype bij hen past, moeten de leerlingen nadenken over vragen als: Wie ben ik? Wat kan ik? Wat wil ik? âHet project "Paspoort naar je toekomstdroomâ , faciliteert de leerlingen en de docent hierbij. De rolmodellen uit de TV-,film en sportwereld, die de workshops samen met de docent geven, stimuleren de jongeren extra om serieus met hun toekomst aan de slag te gaan.</p>', 'Home', '', 'inherit', 'open', 'open', '', '2-revision-v1', '', '', '2014-10-20 10:33:57', '2014-10-20 09:33:57', '', 2, 'http://www.projectpaspoort.nl/2-revision-v1/', 0, 'revision', '', 0),
