(1352, 1452849101, 'new', 'file', 2, '22d4707fff3b8e92a57058b3c053bb07', 'f3a39d01c2f1d2dccefb21c7c84638e7', 'Modified plugin file: wp-content/plugins/akismet/readme.txt', 'This file belongs to plugin "Akismet" version "3.1.3" and has been modified from the file that is distributed by WordPress.org for this version. Please use the link to see how the file has changed. If you have modified this file yourself, you can safely ignore this warning. If you see a lot of changed files in a plugin that have been made by the author, then try uninstalling and reinstalling the plugin to force an upgrade. Doing this is a workaround for plugin authors who don''t manage their code correctly. [See our FAQ on www.wordfence.com for more info]', 'a:8:{s:4:"file";s:37:"wp-content/plugins/akismet/readme.txt";s:5:"cType";s:6:"plugin";s:7:"canDiff";b:1;s:6:"canFix";b:1;s:9:"canDelete";b:0;s:5:"cName";s:7:"Akismet";s:8:"cVersion";s:5:"3.1.3";s:4:"cKey";s:19:"akismet/akismet.php";}'),
(1353, 1452849849, 'new', 'wfPluginUpgrade', 1, 'e2c1e2d01722b46b2dbe82487eed6ac9', 'e2c1e2d01722b46b2dbe82487eed6ac9', 'The Plugin "Admin Menu Editor" needs an upgrade.', 'You need to upgrade "Admin Menu Editor" to the newest version to ensure you have any security fixes the developer has released.', 'a:13:{s:4:"Name";s:17:"Admin Menu Editor";s:9:"PluginURI";s:68:"http://w-shadow.com/blog/2008/12/20/admin-menu-editor-for-wordpress/";s:7:"Version";s:5:"1.4.4";s:11:"Description";s:195:"Lets you directly edit the WordPress admin menu. You can re-order, hide or rename existing menus, add custom menus and more. <cite>Door <a href="http://w-shadow.com/blog/">Janis Elsts</a>.</cite>";s:6:"Author";s:51:"<a href="http://w-shadow.com/blog/">Janis Elsts</a>";s:9:"AuthorURI";s:25:"http://w-shadow.com/blog/";s:10:"TextDomain";s:0:"";s:10:"DomainPath";s:0:"";s:7:"Network";b:0;s:5:"Title";s:100:"<a href="http://w-shadow.com/blog/2008/12/20/admin-menu-editor-for-wordpress/">Admin Menu Editor</a>";s:10:"AuthorName";s:11:"Janis Elsts";s:10:"pluginFile";s:108:"/home/projectpas/domains/projectpaspoort.nl/public_html/wp-content/plugins/admin-menu-editor/menu-editor.php";s:10:"newVersion";s:3:"1.5";}'),
(1354, 1452849849, 'new', 'wfPluginUpgrade', 1, 'd5599feb7f55cf25c7cb041bd7b7fdf3', 'd5599feb7f55cf25c7cb041bd7b7fdf3', 'The Plugin "Advanced Custom Fields" needs an upgrade.', 'You need to upgrade "Advanced Custom Fields" to the newest version to ensure you have any security fixes the developer has released.', 'a:13:{s:4:"Name";s:22:"Advanced Custom Fields";s:9:"PluginURI";s:36:"http://www.advancedcustomfields.com/";s:7:"Version";s:5:"4.4.2";s:11:"Description";s:144:"Customise WordPress with powerful, professional and intuitive fields <cite>Door <a href="http://www.elliotcondon.com/">Elliot Condon</a>.</cite>";s:6:"Author";s:56:"<a href="http://www.elliotcondon.com/">Elliot Condon</a>";s:9:"AuthorURI";s:28:"http://www.elliotcondon.com/";s:10:"TextDomain";s:0:"";s:10:"DomainPath";s:0:"";s:7:"Network";b:0;s:5:"Title";s:73:"<a href="http://www.advancedcustomfields.com/">Advanced Custom Fields</a>";s:10:"AuthorName";s:13:"Elliot Condon";s:10:"pluginFile";s:105:"/home/projectpas/domains/projectpaspoort.nl/public_html/wp-content/plugins/advanced-custom-fields/acf.php";s:10:"newVersion";s:5:"4.4.5";}'),
(1355, 1452849849, 'new', 'wfPluginUpgrade', 1, '3032a56937ebc7959caa253675242e36', '3032a56937ebc7959caa253675242e36', 'The Plugin "Akismet" needs an upgrade.', 'You need to upgrade "Akismet" to the newest version to ensure you have any security fixes the developer has released.', 'a:13:{s:4:"Name";s:7:"Akismet";s:9:"PluginURI";s:19:"http://akismet.com/";s:7:"Version";s:5:"3.1.3";s:11:"Description";s:556:"Akismet wordt gebruikt door velen en is hoogstwaarschijnlijk de best manier ter wereld om <strong>je blog te beschermen tegen reactie- en trackback-spam</strong>. Zelfs terwijl je slaapt, beschermt het je website tegen spam. Om het te gebruiken: 1) Klik op de &#8220;Activeren&#8221; link, links van deze uitleg, 2) <a href="http://akismet.com/get/">Meld je aan om een Akismet API-sleutel te krijgen</a>, en 3) Ga naar je Akismet configuratie-pagina en sla je API-key op. <cite>Door <a href="http://automattic.com/wordpress-plugins/">Automattic</a>.</cite>";s:6:"Author";s:65:"<a href="http://automattic.com/wordpress-plugins/">Automattic</a>";s:9:"AuthorURI";s:40:"http://automattic.com/wordpress-plugins/";s:10:"TextDomain";s:7:"akismet";s:10:"DomainPath";s:0:"";s:7:"Network";b:0;s:5:"Title";s:41:"<a href="http://akismet.com/">Akismet</a>";s:10:"AuthorName";s:10:"Automattic";s:10:"pluginFile";s:94:"/home/projectpas/domains/projectpaspoort.nl/public_html/wp-content/plugins/akismet/akismet.php";s:10:"newVersion";s:5:"3.1.7";}'),
(1356, 1452849849, 'new', 'wfPluginUpgrade', 1, '4e984642310805a416aa310d41cc8c65', '4e984642310805a416aa310d41cc8c65', 'The Plugin "Anti-Malware and Brute-Force Security by ELI" needs an upgrade.', 'You need to upgrade "Anti-Malware and Brute-Force Security by ELI" to the newest version to ensure you have any security fixes the developer has released.', 'a:13:{s:4:"Name";s:44:"Anti-Malware and Brute-Force Security by ELI";s:9:"PluginURI";s:18:"http://gotmls.net/";s:7:"Version";s:7:"4.15.30";s:11:"Description";s:367:"This Anti-Virus/Anti-Malware plugin searches for Malware and other Virus like threats and vulnerabilities on your server and helps you remove them. It&#8217;s always growing and changing to adapt to new threats so let me know if it&#8217;s not working for you. <cite>Door <a href="http://wordpress.ieonly.com/category/my-plugins/anti-malware/">Eli Scheetz</a>.</cite>";s:6:"Author";s:87:"<a href="http://wordpress.ieonly.com/category/my-plugins/anti-malware/">Eli Scheetz</a>";s:9:"AuthorURI";s:61:"http://wordpress.ieonly.com/category/my-plugins/anti-malware/";s:10:"TextDomain";s:6:"gotmls";s:10:"DomainPath";s:0:"";s:7:"Network";b:0;s:5:"Title";s:77:"<a href="http://gotmls.net/">Anti-Malware and Brute-Force Security by ELI</a>";s:10:"AuthorName";s:11:"Eli Scheetz";s:10:"pluginFile";s:91:"/home/projectpas/domains/projectpaspoort.nl/public_html/wp-content/plugins/gotmls/index.php";s:10:"newVersion";s:7:"4.15.49";}'),
(1357, 1452849849, 'new', 'wfPluginUpgrade', 1, '8116094a77ce0c7f1136a7458dba56ff', '8116094a77ce0c7f1136a7458dba56ff', 'The Plugin "BackUpWordPress" needs an upgrade.', 'You need to upgrade "BackUpWordPress" to the newest version to ensure you have any security fixes the developer has released.', 'a:13:{s:4:"Name";s:15:"BackUpWordPress";s:9:"PluginURI";s:18:"http://bwp.hmn.md/";s:7:"Version";s:5:"3.2.7";s:11:"Description";s:275:"Simple automated backups of your WordPress powered website. Once activated you&#8217;ll find me under <strong>Tools &rarr; Backups</strong>. On multisite, you&#8217;ll find me under the Network Settings menu. <cite>Door <a href="http://hmn.md/">Human Made Limited</a>.</cite>";s:6:"Author";s:47:"<a href="http://hmn.md/">Human Made Limited</a>";s:9:"AuthorURI";s:14:"http://hmn.md/";s:10:"TextDomain";s:15:"backupwordpress";s:10:"DomainPath";s:10:"/languages";s:7:"Network";b:1;s:5:"Title";s:48:"<a href="http://bwp.hmn.md/">BackUpWordPress</a>";s:10:"AuthorName";s:18:"Human Made Limited";s:10:"pluginFile";s:110:"/home/projectpas/domains/projectpaspoort.nl/public_html/wp-content/plugins/backupwordpress/backupwordpress.php";s:10:"newVersion";s:5:"3.3.4";}'),
